#' @export
AccessPointRule <- R6::R6Class(
  "AccessPointRule",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x4679b65f,
    SUBCLASS_OF_ID = 0xb1aca0fd,


    #' @field phone_prefix_rules A string representing phone prefix rules.
    phone_prefix_rules = NULL,

    #' @field dc_id An integer representing the data center ID.
    dc_id = NULL,

    #' @field ips A list of TypeIpPort objects representing IPs.
    ips = NULL,

    #' @description
    #' Initializes the AccessPointRule with the given parameters.
    #' @param phone_prefix_rules A string representing phone prefix rules.
    #' @param dc_id An integer representing the data center ID.
    #' @param ips A list of TypeIpPort objects representing IPs.
    initialize = function(phone_prefix_rules, dc_id, ips) {
      self$phone_prefix_rules <- phone_prefix_rules
      self$dc_id <- dc_id
      self$ips <- ips
    },

    #' @description
    #' Converts the AccessPointRule object to a list (dictionary).
    #' @return A list representation of the AccessPointRule object.
    to_dict = function() {
      return(list(
        `_` = "AccessPointRule",
        phone_prefix_rules = self$phone_prefix_rules,
        dc_id = self$dc_id,
        ips = lapply(self$ips, function(x) if (inherits(x, "TLObject")) x$to_dict() else x)
      ))
    },

    #' @description
    #' Serializes the AccessPointRule object to bytes.
    #' @return A raw vector representing the serialized bytes of the AccessPointRule object.
    bytes = function() {
      return(do.call(c, list(
        as.raw(c(0x5f, 0xb6, 0x79, 0x46)),
        self$serializebytes(self$phone_prefix_rules),
        writeBin(as.integer(self$dc_id), raw(), size = 4, endian = "little"),
        writeBin(as.integer(length(self$ips)), raw(), size = 4, endian = "little"),
        do.call(c, lapply(self$ips, function(x) x$bytes()))
      )))
    }
  ),

  private = list(

    #' @description
    #' Reads an AccessPointRule object from a BinaryReader.
    #' @param reader A BinaryReader object to read from.
    #' @return An instance of AccessPointRule.
    from_reader = function(reader) {
      phone_prefix_rules <- reader$tgread_string()
      dc_id <- reader$read_int()
      ips <- list()
      for (i in seq_len(reader$read_int())) {
        ips[[i]] <- reader$tgread_object()
      }
      return(AccessPointRule$new(phone_prefix_rules, dc_id, ips))
    }
  )
)

