#' @export
AttachMenuBot <- R6::R6Class(
  "AttachMenuBot",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0xd90d8dfe,
    SUBCLASS_OF_ID = 0x9f087446,

    bot_id = NULL,
    short_name = NULL,
    icons = NULL,
    inactive = NULL,
    has_settings = NULL,
    request_write_access = NULL,
    show_in_attach_menu = NULL,
    show_in_side_menu = NULL,
    side_menu_disclaimer_needed = NULL,
    peer_types = NULL,

    #' @description
    #' Initializes the AttachMenuBot with the given parameters.
    #' @param bot_id An integer representing the bot ID.
    #' @param short_name A string representing the short name.
    #' @param icons A list of TypeAttachMenuBotIcon objects.
    #' @param inactive Optional boolean indicating if inactive.
    #' @param has_settings Optional boolean indicating if has settings.
    #' @param request_write_access Optional boolean indicating if requests write access.
    #' @param show_in_attach_menu Optional boolean indicating if shows in attach menu.
    #' @param show_in_side_menu Optional boolean indicating if shows in side menu.
    #' @param side_menu_disclaimer_needed Optional boolean indicating if side menu disclaimer needed.
    #' @param peer_types Optional list of TypeAttachMenuPeerType objects.
    initialize = function(bot_id, short_name, icons, inactive = NULL, has_settings = NULL, request_write_access = NULL, show_in_attach_menu = NULL, show_in_side_menu = NULL, side_menu_disclaimer_needed = NULL, peer_types = NULL) {
      self$bot_id <- bot_id
      self$short_name <- short_name
      self$icons <- icons
      self$inactive <- inactive
      self$has_settings <- has_settings
      self$request_write_access <- request_write_access
      self$show_in_attach_menu <- show_in_attach_menu
      self$show_in_side_menu <- show_in_side_menu
      self$side_menu_disclaimer_needed <- side_menu_disclaimer_needed
      self$peer_types <- peer_types
    },

    #' @description
    #' Converts the AttachMenuBot object to a list (dictionary).
    #' @return A list representation of the AttachMenuBot object.
    to_dict = function() {
      return(list(
        `_` = "AttachMenuBot",
        bot_id = self$bot_id,
        short_name = self$short_name,
        icons = if (is.null(self$icons)) list() else lapply(self$icons, function(x) if (inherits(x, "TLObject")) x$to_dict() else x),
        inactive = self$inactive,
        has_settings = self$has_settings,
        request_write_access = self$request_write_access,
        show_in_attach_menu = self$show_in_attach_menu,
        show_in_side_menu = self$show_in_side_menu,
        side_menu_disclaimer_needed = self$side_menu_disclaimer_needed,
        peer_types = if (is.null(self$peer_types)) list() else lapply(self$peer_types, function(x) if (inherits(x, "TLObject")) x$to_dict() else x)
      ))
    },

    #' @description
    #' Serializes the AttachMenuBot object to bytes.
    #' @return A raw vector representing the serialized bytes of the AttachMenuBot object.
    bytes = function() {
      # Assert validation
      if (!((self$show_in_attach_menu || !is.null(self$show_in_attach_menu)) &&
        (self$peer_types || !is.null(self$peer_types))) &&
        !((is.null(self$show_in_attach_menu) || isFALSE(self$show_in_attach_menu)) &&
          (is.null(self$peer_types) || isFALSE(self$peer_types)))) {
        stop("show_in_attach_menu, peer_types parameters must all be FALSE-y (like NULL) or all be TRUE-y")
      }

      # Calculate flags
      flags <- 0
      if (!is.null(self$inactive) && self$inactive) flags <- flags + 1
      if (!is.null(self$has_settings) && self$has_settings) flags <- flags + 2
      if (!is.null(self$request_write_access) && self$request_write_access) flags <- flags + 4
      if (!is.null(self$show_in_attach_menu) && self$show_in_attach_menu) flags <- flags + 8
      if (!is.null(self$show_in_side_menu) && self$show_in_side_menu) flags <- flags + 16
      if (!is.null(self$side_menu_disclaimer_needed) && self$side_menu_disclaimer_needed) flags <- flags + 32
      if (!is.null(self$peer_types) && length(self$peer_types) > 0) flags <- flags + 8

      result <- list(
        as.raw(c(0xfe, 0x8d, 0x0d, 0xd9)),
        writeBin(as.integer(flags), raw(), size = 4, endian = "little"),
        writeBin(as.numeric(self$bot_id), raw(), size = 8, endian = "little"),
        self$serializebytes(self$short_name)
      )

      # Add peer_types if present
      if (!is.null(self$peer_types) && length(self$peer_types) > 0) {
        result <- append(result, list(
          as.raw(c(0x15, 0xc4, 0xb5, 0x1c)),
          writeBin(as.integer(length(self$peer_types)), raw(), size = 4, endian = "little"),
          do.call(c, lapply(self$peer_types, function(x) x$bytes()))
        ))
      }

      # Add icons
      result <- append(result, list(
        as.raw(c(0x15, 0xc4, 0xb5, 0x1c)),
        writeBin(as.integer(length(self$icons)), raw(), size = 4, endian = "little"),
        do.call(c, lapply(self$icons, function(x) x$bytes()))
      ))

      return(do.call(c, result))
    }
  ),

  private = list(
    #' @description
    #' Reads an AttachMenuBot object from a BinaryReader.
    #' @param reader A BinaryReader object to read from.
    #' @return An instance of AttachMenuBot.
    from_reader = function(reader) {
      flags <- reader$read_int()

      inactive <- bitwAnd(flags, 1) != 0
      has_settings <- bitwAnd(flags, 2) != 0
      request_write_access <- bitwAnd(flags, 4) != 0
      show_in_attach_menu <- bitwAnd(flags, 8) != 0
      show_in_side_menu <- bitwAnd(flags, 16) != 0
      side_menu_disclaimer_needed <- bitwAnd(flags, 32) != 0

      bot_id <- reader$read_long()
      short_name <- reader$tgread_string()

      # Read peer_types if present
      peer_types <- NULL
      if (bitwAnd(flags, 8) != 0) {
        reader$read_int()
        peer_types <- list()
        npeer_types <- reader$read_int()
        for (i in seq_len(npeer_types)) {
          peer_types[[i]] <- reader$tgread_object()
        }
      }

      # Read icons
      reader$read_int()
      icons <- list()
      n_icons <- reader$read_int()
      for (i in seq_len(n_icons)) {
        icons[[i]] <- reader$tgread_object()
      }

      return(AttachMenuBot$new(
        bot_id = bot_id,
        short_name = short_name,
        icons = icons,
        inactive = inactive,
        has_settings = has_settings,
        request_write_access = request_write_access,
        show_in_attach_menu = show_in_attach_menu,
        show_in_side_menu = show_in_side_menu,
        side_menu_disclaimer_needed = side_menu_disclaimer_needed,
        peer_types = peer_types
      ))
    }
  )
)

#' @export
AttachMenuBotIcon <- R6::R6Class(
  "AttachMenuBotIcon",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0xb2a7386b,
    SUBCLASS_OF_ID = 0x80484555,

    name = NULL,
    icon = NULL,
    colors = NULL,

    #' @description
    #' Initializes the AttachMenuBotIcon with the given parameters.
    #' @param name A string representing the icon name.
    #' @param icon A TypeDocument object representing the icon.
    #' @param colors Optional list of TypeAttachMenuBotIconColor objects.
    initialize = function(name, icon, colors = NULL) {
      self$name <- name
      self$icon <- icon
      self$colors <- colors
    },

    #' @description
    #' Converts the AttachMenuBotIcon object to a list (dictionary).
    #' @return A list representation of the AttachMenuBotIcon object.
    to_dict = function() {
      return(list(
        `_` = "AttachMenuBotIcon",
        name = self$name,
        icon = if (inherits(self$icon, "TLObject")) self$icon$to_dict() else self$icon,
        colors = if (is.null(self$colors)) list() else lapply(self$colors, function(x) if (inherits(x, "TLObject")) x$to_dict() else x)
      ))
    },

    #' @description
    #' Serializes the AttachMenuBotIcon object to bytes.
    #' @return A raw vector representing the serialized bytes of the AttachMenuBotIcon object.
    bytes = function() {
      flags <- if (!is.null(self$colors) && length(self$colors) > 0) 1 else 0

      result <- list(
        as.raw(c(0x6b, 0x38, 0xa7, 0xb2)),
        writeBin(as.integer(flags), raw(), size = 4, endian = "little"),
        self$serializebytes(self$name),
        self$icon$bytes()
      )

      if (!is.null(self$colors) && length(self$colors) > 0) {
        result <- append(result, list(
          as.raw(c(0x15, 0xc4, 0xb5, 0x1c)),
          writeBin(as.integer(length(self$colors)), raw(), size = 4, endian = "little"),
          do.call(c, lapply(self$colors, function(x) x$bytes()))
        ))
      }

      return(do.call(c, result))
    }
  ),

  private = list(
    #' @description
    #' Reads an AttachMenuBotIcon object from a BinaryReader.
    #' @param reader A BinaryReader object to read from.
    #' @return An instance of AttachMenuBotIcon.
    from_reader = function(reader) {
      flags <- reader$read_int()

      name <- reader$tgread_string()
      icon <- reader$tgread_object()

      colors <- NULL
      if (bitwAnd(flags, 1) != 0) {
        reader$read_int()
        colors <- list()
        n_colors <- reader$read_int()
        for (i in seq_len(n_colors)) {
          colors[[i]] <- reader$tgread_object()
        }
      }

      return(AttachMenuBotIcon$new(name = name, icon = icon, colors = colors))
    }
  )
)

