#' @export
AttachMenuBots <- R6::R6Class(
  "AttachMenuBots",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x3c4301c0,
    SUBCLASS_OF_ID = 0x842e23da,

    hash = NULL,
    bots = NULL,
    users = NULL,

    #' @description
    #' Initializes the AttachMenuBots with the given parameters.
    #' @param hash An integer representing the hash value.
    #' @param bots A list of TypeAttachMenuBot objects.
    #' @param users A list of TypeUser objects.
    initialize = function(hash, bots, users) {
      self$hash <- hash
      self$bots <- bots
      self$users <- users
    },

    #' @description
    #' Converts the AttachMenuBots object to a list (dictionary).
    #' @return A list representation of the AttachMenuBots object.
    to_dict = function() {
      return(list(
        `_` = "AttachMenuBots",
        hash = self$hash,
        bots = if (is.null(self$bots)) list() else lapply(self$bots, function(x) if (inherits(x, "TLObject")) x$to_dict() else x),
        users = if (is.null(self$users)) list() else lapply(self$users, function(x) if (inherits(x, "TLObject")) x$to_dict() else x)
      ))
    },

    #' @description
    #' Serializes the AttachMenuBots object to bytes.
    #' @return A raw vector representing the serialized bytes of the AttachMenuBots object.
    bytes = function() {
      return(do.call(c, list(
        as.raw(c(0xc0, 0x01, 0x43, 0x3c)),
        writeBin(as.numeric(self$hash), raw(), size = 8, endian = "little"),
        as.raw(c(0x15, 0xc4, 0xb5, 0x1c)),
        writeBin(as.integer(length(self$bots)), raw(), size = 4, endian = "little"),
        do.call(c, lapply(self$bots, function(x) x$bytes())),
        as.raw(c(0x15, 0xc4, 0xb5, 0x1c)),
        writeBin(as.integer(length(self$users)), raw(), size = 4, endian = "little"),
        do.call(c, lapply(self$users, function(x) x$bytes()))
      )))
    }
  ),

  private = list(
    #' @description
    #' Reads an AttachMenuBots object from a BinaryReader.
    #' @param reader A BinaryReader object to read from.
    #' @return An instance of AttachMenuBots.
    from_reader = function(reader) {
      hash <- reader$read_long()

      reader$read_int()
      bots <- list()
      n_bots <- reader$read_int()
      for (i in seq_len(n_bots)) {
        bots[[i]] <- reader$tgread_object()
      }

      reader$read_int()
      users <- list()
      n_users <- reader$read_int()
      for (i in seq_len(n_users)) {
        users[[i]] <- reader$tgread_object()
      }

      return(AttachMenuBots$new(hash = hash, bots = bots, users = users))
    }
  )
)

