    region = NULL,
    current = NULL,
    official_app = NULL,
    password_pending = NULL,
    encrypted_requests_disabled = NULL,
    call_requests_disabled = NULL,
    unconfirmed = NULL,

    #' @description
    #' Initializes the Authorization with the given parameters.
    #' @param hash An integer representing the hash value.
    #' @param device_model A string representing the device model.
    #' @param platform A string representing the platform.
    #' @param system_version A string representing the system version.
    #' @param api_id An integer representing the API ID.
    #' @param app_name A string representing the application name.
    #' @param app_version A string representing the application version.
    #' @param date_created Optional datetime representing when created.
    #' @param date_active Optional datetime representing when last active.
    #' @param ip A string representing the IP address.
    #' @param country A string representing the country.
    #' @param region A string representing the region.
    #' @param current Optional boolean indicating if current session.
    #' @param official_app Optional boolean indicating if official app.
    #' @param password_pending Optional boolean indicating if password pending.
    #' @param encrypted_requests_disabled Optional boolean indicating if encrypted requests disabled.
    #' @param call_requests_disabled Optional boolean indicating if call requests disabled.
    #' @param unconfirmed Optional boolean indicating if unconfirmed.
    initialize = function(hash, device_model, platform, system_version, api_id, app_name, app_version, date_created, date_active, ip, country, region, current = NULL, official_app = NULL, password_pending = NULL, encrypted_requests_disabled = NULL, call_requests_disabled = NULL, unconfirmed = NULL) {
      self$hash <- hash
      self$device_model <- device_model
      self$platform <- platform
      self$system_version <- system_version
      self$api_id <- api_id
      self$app_name <- app_name
      self$app_version <- app_version
      self$date_created <- date_created
      self$date_active <- date_active
      self$ip <- ip
      self$country <- country
      self$region <- region
      self$current <- current
      self$official_app <- official_app
      self$password_pending <- password_pending
      self$encrypted_requests_disabled <- encrypted_requests_disabled
      self$call_requests_disabled <- call_requests_disabled
      self$unconfirmed <- unconfirmed
    },

    #' @description
    #' Converts the Authorization object to a list (dictionary).
    #' @return A list representation of the Authorization object.
    to_dict = function() {
      return(list(
        `_` = "Authorization",
        hash = self$hash,
        device_model = self$device_model,
        platform = self$platform,
        system_version = self$system_version,
        api_id = self$api_id,
        app_name = self$app_name,
        app_version = self$app_version,
        date_created = self$date_created,
        date_active = self$date_active,
        ip = self$ip,
        country = self$country,
        region = self$region,
        current = self$current,
        official_app = self$official_app,
        password_pending = self$password_pending,
        encrypted_requests_disabled = self$encrypted_requests_disabled,
        call_requests_disabled = self$call_requests_disabled,
        unconfirmed = self$unconfirmed
      ))
    },

    #' @description
    #' Serializes the Authorization object to bytes.
    #' @return A raw vector representing the serialized bytes of the Authorization object.
    bytes = function() {
      # Calculate flags
      flags <- 0
      if (!is.null(self$current) && self$current) flags <- flags + 1
      if (!is.null(self$official_app) && self$official_app) flags <- flags + 2
      if (!is.null(self$password_pending) && self$password_pending) flags <- flags + 4
      if (!is.null(self$encrypted_requests_disabled) && self$encrypted_requests_disabled) flags <- flags + 8
      if (!is.null(self$call_requests_disabled) && self$call_requests_disabled) flags <- flags + 16
      if (!is.null(self$unconfirmed) && self$unconfirmed) flags <- flags + 32

      return(do.call(c, list(
        as.raw(c(0x1d, 0xd6, 0x01, 0xad)),
        writeBin(as.integer(flags), raw(), size = 4, endian = "little"),
        writeBin(as.numeric(self$hash), raw(), size = 8, endian = "little"),
        self$serializebytes(self$device_model),
        self$serializebytes(self$platform),
        self$serializebytes(self$system_version),
        writeBin(as.integer(self$api_id), raw(), size = 4, endian = "little"),
        self$serializebytes(self$app_name),
        self$serializebytes(self$app_version),
        self$serialize_datetime(self$date_created),
