    #' @return An instance of Authorization.
    from_reader = function(reader) {
      flags <- reader$read_int()

      current <- bitwAnd(flags, 1) != 0
      official_app <- bitwAnd(flags, 2) != 0
      password_pending <- bitwAnd(flags, 4) != 0
      encrypted_requests_disabled <- bitwAnd(flags, 8) != 0
      call_requests_disabled <- bitwAnd(flags, 16) != 0
      unconfirmed <- bitwAnd(flags, 32) != 0

      hash <- reader$read_long()
      device_model <- reader$tgread_string()
      platform <- reader$tgread_string()
      system_version <- reader$tgread_string()
      api_id <- reader$read_int()
      app_name <- reader$tgread_string()
      app_version <- reader$tgread_string()
      date_created <- reader$tgread_date()
      date_active <- reader$tgread_date()
      ip <- reader$tgread_string()
      country <- reader$tgread_string()
      region <- reader$tgread_string()

      return(Authorization$new(
        hash = hash,
        device_model = device_model,
        platform = platform,
        system_version = system_version,
        api_id = api_id,
        app_name = app_name,
        app_version = app_version,
        date_created = date_created,
        date_active = date_active,
        ip = ip,
        country = country,
        region = region,
        current = current,
