    #' @description
    #' Initializes the AvailableEffect with the given parameters.
    #' @param id An integer representing the effect ID.
    #' @param emoticon A string representing the emoticon.
    #' @param effect_sticker_id An integer representing the effect sticker ID.
    #' @param premium_required Optional boolean indicating if premium is required.
    #' @param static_icon_id Optional integer representing the static icon ID.
    #' @param effect_animation_id Optional integer representing the effect animation ID.
    initialize = function(id, emoticon, effect_sticker_id, premium_required = NULL, static_icon_id = NULL, effect_animation_id = NULL) {
      self$id <- id
      self$emoticon <- emoticon
      self$effect_sticker_id <- effect_sticker_id
      self$premium_required <- premium_required
      self$static_icon_id <- static_icon_id
      self$effect_animation_id <- effect_animation_id
    },

    #' @description
    #' Converts the AvailableEffect object to a list (dictionary).
    #' @return A list representation of the AvailableEffect object.
    to_dict = function() {
      return(list(
        `_` = "AvailableEffect",
        id = self$id,
        emoticon = self$emoticon,
        effect_sticker_id = self$effect_sticker_id,
        premium_required = self$premium_required,
        static_icon_id = self$static_icon_id,
        effect_animation_id = self$effect_animation_id
      ))
    },

    #' @description
    #' Serializes the AvailableEffect object to bytes.
    #' @return A raw vector representing the serialized bytes of the AvailableEffect object.
    bytes = function() {
      # Calculate flags
      flags <- 0
      if (!is.null(self$premium_required) && self$premium_required) flags <- flags + 4
      if (!is.null(self$static_icon_id)) flags <- flags + 1
      if (!is.null(self$effect_animation_id)) flags <- flags + 2

      result <- list(
        as.raw(c(0x7e, 0xe2, 0xc3, 0x93)),
        writeBin(as.integer(flags), raw(), size = 4, endian = "little"),
        writeBin(as.numeric(self$id), raw(), size = 8, endian = "little"),
        self$serializebytes(self$emoticon)
      )

      if (!is.null(self$static_icon_id)) {
        result <- append(result, list(
          writeBin(as.numeric(self$static_icon_id), raw(), size = 8, endian = "little")
        ))
      }

      result <- append(result, list(
        writeBin(as.numeric(self$effect_sticker_id), raw(), size = 8, endian = "little")
      ))

      if (!is.null(self$effect_animation_id)) {
        result <- append(result, list(
          writeBin(as.numeric(self$effect_animation_id), raw(), size = 8, endian = "little")
        ))
      }

      return(do.call(c, result))
    }
  ),

  private = list(
    #' @description
    #' Reads an AvailableEffect object from a BinaryReader.
    #' @param reader A BinaryReader object to read from.
    #' @return An instance of AvailableEffect.
    from_reader = function(reader) {
      flags <- reader$read_int()

      premium_required <- bitwAnd(flags, 4) != 0
      id <- reader$read_long()
      emoticon <- reader$tgread_string()

      static_icon_id <- NULL
      if (bitwAnd(flags, 1) != 0) {
        static_icon_id <- reader$read_long()
      }

      effect_sticker_id <- reader$read_long()

      effect_animation_id <- NULL
      if (bitwAnd(flags, 2) != 0) {
        effect_animation_id <- reader$read_long()
      }

      return(AvailableEffect$new(
        id = id,
        emoticon = emoticon,
        effect_sticker_id = effect_sticker_id,
