#' @export
AvailableReaction <- R6::R6Class(
  "AvailableReaction",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0xc077ec01,
    SUBCLASS_OF_ID = 0x8c1c9d73,

    reaction = NULL,
    title = NULL,
    static_icon = NULL,
    appear_animation = NULL,
    select_animation = NULL,
    activate_animation = NULL,
    effect_animation = NULL,
    inactive = NULL,
    premium = NULL,
    around_animation = NULL,
    center_icon = NULL,

    #' @description
    #' Initializes the AvailableReaction with the given parameters.
    #' @param reaction A string representing the reaction.
    #' @param title A string representing the title.
    #' @param static_icon A TLObject representing the static icon.
    #' @param appear_animation A TLObject representing the appear animation.
    #' @param select_animation A TLObject representing the select animation.
    #' @param activate_animation A TLObject representing the activate animation.
    #' @param effect_animation A TLObject representing the effect animation.
    #' @param inactive A logical indicating if inactive. Optional.
    #' @param premium A logical indicating if premium. Optional.
    #' @param around_animation A TLObject representing the around animation. Optional.
    #' @param center_icon A TLObject representing the center icon. Optional.
    initialize = function(reaction, title, static_icon, appear_animation, select_animation,
                          activate_animation, effect_animation, inactive = NULL, premium = NULL,
                          around_animation = NULL, center_icon = NULL) {
      self$reaction <- reaction
      self$title <- title
      self$static_icon <- static_icon
      self$appear_animation <- appear_animation
      self$select_animation <- select_animation
      self$activate_animation <- activate_animation
      self$effect_animation <- effect_animation
      self$inactive <- inactive
      self$premium <- premium
      self$around_animation <- around_animation
      self$center_icon <- center_icon
    },

    #' @description
    #' Converts the AvailableReaction object to a list (dictionary).
    #' @return A list representation of the AvailableReaction object.
    to_dict = function() {
      return(list(
        `_` = "AvailableReaction",
        reaction = self$reaction,
        title = self$title,
        static_icon = if (inherits(self$static_icon, "TLObject")) self$static_icon$to_dict() else self$static_icon,
        appear_animation = if (inherits(self$appear_animation, "TLObject")) self$appear_animation$to_dict() else self$appear_animation,
        select_animation = if (inherits(self$select_animation, "TLObject")) self$select_animation$to_dict() else self$select_animation,
        activate_animation = if (inherits(self$activate_animation, "TLObject")) self$activate_animation$to_dict() else self$activate_animation,
        effect_animation = if (inherits(self$effect_animation, "TLObject")) self$effect_animation$to_dict() else self$effect_animation,
        inactive = self$inactive,
        premium = self$premium,
        around_animation = if (inherits(self$around_animation, "TLObject")) self$around_animation$to_dict() else self$around_animation,
        center_icon = if (inherits(self$center_icon, "TLObject")) self$center_icon$to_dict() else self$center_icon
      ))
    },

    #' @description
    #' Serializes the AvailableReaction object to bytes.
    #' @return A raw vector representing the serialized bytes of the AvailableReaction object.
    bytes = function() {
      # Validation similar to the assertion in Python
      if (!(((!is.null(self$around_animation) && !identical(self$around_animation, FALSE)) &&
        (!is.null(self$center_icon) && !identical(self$center_icon, FALSE))) ||
        ((is.null(self$around_animation) || identical(self$around_animation, FALSE)) &&
          (is.null(self$center_icon) || identical(self$center_icon, FALSE))))) {
        stop("around_animation, center_icon parameters must all be falsy (like NULL) or all be truthy")
      }

      flags <- 0
      if (!is.null(self$inactive) && !identical(self$inactive, FALSE)) flags <- flags + 1 # 2^0
      if (!is.null(self$premium) && !identical(self$premium, FALSE)) flags <- flags + 4 # 2^2
      if (!is.null(self$around_animation) && !identical(self$around_animation, FALSE)) flags <- flags + 2 # 2^1
      if (!is.null(self$center_icon) && !identical(self$center_icon, FALSE)) flags <- flags + 2 # 2^1

      result <- list(
        as.raw(c(0x01, 0xec, 0x77, 0xc0)),
        writeBin(as.integer(flags), raw(), size = 4, endian = "little"),
        self$serializebytes(self$reaction),
        self$serializebytes(self$title),
        self$static_icon$`bytes`(),
        self$appear_animation$`bytes`(),
        self$select_animation$`bytes`(),
        self$activate_animation$`bytes`(),
        self$effect_animation$`bytes`()
      )

      if (!is.null(self$around_animation) && !identical(self$around_animation, FALSE)) {
        result <- append(result, list(self$around_animation$`bytes`()))
      }
      if (!is.null(self$center_icon) && !identical(self$center_icon, FALSE)) {
        result <- append(result, list(self$center_icon$`bytes`()))
      }

      return(do.call(c, result))
    }
  ),

  private = list(
    #' @description
    #' Reads an AvailableReaction object from a BinaryReader.
    #' @param reader A BinaryReader object to read from.
    #' @return An instance of AvailableReaction.
    from_reader = function(reader) {
      flags <- reader$read_int()

      inactive <- bitwAnd(flags, 1) != 0
      premium <- bitwAnd(flags, 4) != 0
      reaction <- reader$tgread_string()
      title <- reader$tgread_string()
      static_icon <- reader$tgread_object()
      appear_animation <- reader$tgread_object()
      select_animation <- reader$tgread_object()
      activate_animation <- reader$tgread_object()
      effect_animation <- reader$tgread_object()

      around_animation <- NULL
      if (bitwAnd(flags, 2) != 0) {
        around_animation <- reader$tgread_object()
      }

      center_icon <- NULL
      if (bitwAnd(flags, 2) != 0) {
        center_icon <- reader$tgread_object()
      }

      return(AvailableReaction$new(
        reaction = reaction,
        title = title,
        static_icon = static_icon,
        appear_animation = appear_animation,
        select_animation = select_animation,
        activate_animation = activate_animation,
        effect_animation = effect_animation,
        inactive = inactive,
        premium = premium,
        around_animation = around_animation,
        center_icon = center_icon
      ))
    }
  )
)

