    #' @param temp_session_id An integer representing the temporary session ID.
    #' @param expires_at A datetime object representing when this expires. Optional.
    initialize = function(nonce, temp_auth_key_id, perm_auth_key_id, temp_session_id, expires_at = NULL) {
      self$nonce <- nonce
      self$temp_auth_key_id <- temp_auth_key_id
      self$perm_auth_key_id <- perm_auth_key_id
      self$temp_session_id <- temp_session_id
      self$expires_at <- expires_at
    },

