      expires_at <- reader$tgread_date()
      return(BindAuthKeyInner$new(
        nonce = nonce,
        temp_auth_key_id = temp_auth_key_id,
        perm_auth_key_id = perm_auth_key_id,
        temp_session_id = temp_session_id,
