#' @export
Birthday <- R6::R6Class(
  "Birthday",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x6c8e1e06,
    SUBCLASS_OF_ID = 0xbe7fd664,

    day = NULL,
    month = NULL,
    year = NULL,

    #' @description
    #' Initializes the Birthday with the given parameters.
    #' @param day An integer representing the day.
    #' @param month An integer representing the month.
    #' @param year An integer representing the year. Optional.
    initialize = function(day, month, year = NULL) {
      self$day <- day
      self$month <- month
      self$year <- year
    },

    #' @description
    #' Converts the Birthday object to a list (dictionary).
    #' @return A list representation of the Birthday object.
    to_dict = function() {
      return(list(
        `_` = "Birthday",
        day = self$day,
        month = self$month,
        year = self$year
      ))
    },

    #' @description
    #' Serializes the Birthday object to bytes.
    #' @return A raw vector representing the serialized bytes of the Birthday object.
    bytes = function() {
      flags <- 0
      if (!is.null(self$year)) flags <- flags + 1 # 2^0

      return(do.call(c, list(
        as.raw(c(0x06, 0x1e, 0x8e, 0x6c)),
        writeBin(as.integer(flags), raw(), size = 4, endian = "little"),
        writeBin(as.integer(self$day), raw(), size = 4, endian = "little"),
        writeBin(as.integer(self$month), raw(), size = 4, endian = "little"),
        if (!is.null(self$year)) writeBin(as.integer(self$year), raw(), size = 4, endian = "little") else raw()
      )))
    }
  ),

  private = list(
    #' @description
    #' Reads a Birthday object from a BinaryReader.
    #' @param reader A BinaryReader object to read from.
    #' @return An instance of Birthday.
    from_reader = function(reader) {
      flags <- reader$read_int()

      day <- reader$read_int()
      month <- reader$read_int()
      year <- NULL
      if (bitwAnd(flags, 1) != 0) {
        year <- reader$read_int()
      }

      return(Birthday$new(day = day, month = month, year = year))
    }
  )
)

