    #' @param multiplier An integer representing the multiplier. Optional.
    #' @param stars An integer representing the stars. Optional.
    initialize = function(id, date = NULL, expires = NULL, gift = NULL, giveaway = NULL,
                          unclaimed = NULL, user_id = NULL, giveaway_msg_id = NULL,
                          used_gift_slug = NULL, multiplier = NULL, stars = NULL) {
      # Validation similar to Python assertion
      if (!(((!is.null(giveaway) && giveaway) && (!is.null(giveaway_msg_id) && giveaway_msg_id)) ||
        ((is.null(giveaway) || !giveaway) && (is.null(giveaway_msg_id) || !giveaway_msg_id)))) {
        stop("giveaway, giveaway_msg_id parameters must all be truthy or all falsy")
      }

      self$id <- id
      self$date <- date
      self$expires <- expires
      self$gift <- gift
      self$giveaway <- giveaway
      self$unclaimed <- unclaimed
      self$user_id <- user_id
      self$giveaway_msg_id <- giveaway_msg_id
      self$used_gift_slug <- used_gift_slug
      self$multiplier <- multiplier
      self$stars <- stars
    },

    #' @description
    #' Converts the Boost object to a list (dictionary).
    #' @return A list representation of the Boost object.
    to_dict = function() {
      return(list(
        `_` = "Boost",
        id = self$id,
        date = self$date,
        expires = self$expires,
        gift = self$gift,
        giveaway = self$giveaway,
        unclaimed = self$unclaimed,
        user_id = self$user_id,
        giveaway_msg_id = self$giveaway_msg_id,
        used_gift_slug = self$used_gift_slug,
        multiplier = self$multiplier,
        stars = self$stars
      ))
    },

    #' @description
    #' Serializes the Boost object to bytes.
    #' @return A raw vector representing the serialized bytes of the Boost object.
    bytes = function() {
      flags <- 0
      if (!is.null(self$gift) && self$gift) flags <- flags + 2 # 2^1
      if (!is.null(self$giveaway) && self$giveaway) flags <- flags + 4 # 2^2
      if (!is.null(self$unclaimed) && self$unclaimed) flags <- flags + 8 # 2^3
      if (!is.null(self$user_id)) flags <- flags + 1 # 2^0
      if (!is.null(self$giveaway_msg_id)) flags <- flags + 4 # 2^2
      if (!is.null(self$used_gift_slug)) flags <- flags + 16 # 2^4
      if (!is.null(self$multiplier)) flags <- flags + 32 # 2^5
      if (!is.null(self$stars)) flags <- flags + 64 # 2^6

      result <- list(
        as.raw(c(0xd6, 0x14, 0x3e, 0x4b)),
        writeBin(as.integer(flags), raw(), size = 4, endian = "little"),
        self$serializebytes(self$id)
      )

      if (!is.null(self$user_id)) {
        result <- append(result, list(writeBin(as.numeric(self$user_id), raw(), size = 8, endian = "little")))
      }
      if (!is.null(self$giveaway_msg_id)) {
        result <- append(result, list(writeBin(as.integer(self$giveaway_msg_id), raw(), size = 4, endian = "little")))
      }

      result <- append(result, list(
        self$serialize_datetime(self$date),
        self$serialize_datetime(self$expires)
      ))

      if (!is.null(self$used_gift_slug)) {
        result <- append(result, list(self$serializebytes(self$used_gift_slug)))
      }
      if (!is.null(self$multiplier)) {
        result <- append(result, list(writeBin(as.integer(self$multiplier), raw(), size = 4, endian = "little")))
      }
      if (!is.null(self$stars)) {
        result <- append(result, list(writeBin(as.numeric(self$stars), raw(), size = 8, endian = "little")))
      }

      return(do.call(c, result))
    }
  ),

  private = list(
    #' @description
    #' Reads a Boost object from a BinaryReader.
    #' @param reader A BinaryReader object to read from.
    #' @return An instance of Boost.
    from_reader = function(reader) {
      flags <- reader$read_int()

      gift <- bitwAnd(flags, 2) != 0
      giveaway <- bitwAnd(flags, 4) != 0
      unclaimed <- bitwAnd(flags, 8) != 0

      id <- reader$tgread_string()

      user_id <- NULL
      if (bitwAnd(flags, 1) != 0) {
        user_id <- reader$read_long()
      }

      giveaway_msg_id <- NULL
      if (bitwAnd(flags, 4) != 0) {
        giveaway_msg_id <- reader$read_int()
      }

      date <- reader$tgread_date()
      expires <- reader$tgread_date()

      used_gift_slug <- NULL
      if (bitwAnd(flags, 16) != 0) {
        used_gift_slug <- reader$tgread_string()
      }

      multiplier <- NULL
      if (bitwAnd(flags, 32) != 0) {
        multiplier <- reader$read_int()
      }

      stars <- NULL
      if (bitwAnd(flags, 64) != 0) {
        stars <- reader$read_long()
      }

      return(Boost$new(
        id = id,
        date = date,
        expires = expires,
        gift = gift,
        giveaway = giveaway,
        unclaimed = unclaimed,
        user_id = user_id,
        giveaway_msg_id = giveaway_msg_id,
        used_gift_slug = used_gift_slug,
        multiplier = multiplier,
        stars = stars
      ))
    }
  )
)

#' @export
BotApp <- R6::R6Class(
  "BotApp",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x95fcd1d6,
    SUBCLASS_OF_ID = 0x20f32ae,

    id = NULL,
    access_hash = NULL,
    short_name = NULL,
    title = NULL,
    description = NULL,
    photo = NULL,
    hash = NULL,
    document = NULL,

    #' @description
    #' Initializes the BotApp with the given parameters.
    #' @param id An integer representing the bot app ID.
    #' @param access_hash An integer representing the access hash.
    #' @param short_name A string representing the short name.
    #' @param title A string representing the title.
    #' @param description A string representing the description.
    #' @param photo A TLObject representing the photo.
    #' @param hash An integer representing the hash.
    #' @param document A TLObject representing the document. Optional.
    initialize = function(id, access_hash, short_name, title, description, photo, hash, document = NULL) {
      self$id <- id
      self$access_hash <- access_hash
      self$short_name <- short_name
      self$title <- title
      self$description <- description
      self$photo <- photo
      self$hash <- hash
      self$document <- document
    },

    #' @description
    #' Converts the BotApp object to a list (dictionary).
    #' @return A list representation of the BotApp object.
    to_dict = function() {
      result <- list(
        `_` = "BotApp",
        id = self$id,
        access_hash = self$access_hash,
        short_name = self$short_name,
        title = self$title,
        description = self$description,
        photo = if (inherits(self$photo, "TLObject")) self$photo$to_dict() else self$photo,
        hash = self$hash
      )

      if (!is.null(self$document)) {
        result$document <- if (inherits(self$document, "TLObject")) self$document$to_dict() else self$document
      }

      return(result)
    },

    #' @description
    #' Serializes the BotApp object to bytes.
    #' @return A raw vector representing the serialized bytes of the BotApp object.
    bytes = function() {
      flags <- 0
      if (!is.null(self$document)) flags <- flags + 1 # 2^0

      result <- list(
        as.raw(c(0xd6, 0xd1, 0xfc, 0x95)),
        writeBin(as.integer(flags), raw(), size = 4, endian = "little"),
        writeBin(as.numeric(self$id), raw(), size = 8, endian = "little"),
        writeBin(as.numeric(self$access_hash), raw(), size = 8, endian = "little"),
        self$serializebytes(self$short_name),
        self$serializebytes(self$title),
        self$serializebytes(self$description),
        self$photo$`bytes`()
      )

      if (!is.null(self$document)) {
        result <- append(result, list(self$document$`bytes`()))
      }

      result <- append(result, list(writeBin(as.numeric(self$hash), raw(), size = 8, endian = "little")))

      return(do.call(c, result))
    }
  ),

  private = list(
    #' @description
    #' Reads a BotApp object from a BinaryReader.
    #' @param reader A BinaryReader object to read from.
    #' @return An instance of BotApp.
    from_reader = function(reader) {
      flags <- reader$read_int()

      id <- reader$read_long()
      access_hash <- reader$read_long()
      short_name <- reader$tgread_string()
      title <- reader$tgread_string()
      description <- reader$tgread_string()
      photo <- reader$tgread_object()

      document <- NULL
      if (bitwAnd(flags, 1) != 0) {
        document <- reader$tgread_object()
      }

      hash <- reader$read_long()

      return(BotApp$new(
        id = id,
        access_hash = access_hash,
        short_name = short_name,
        title = title,
        description = description,
        photo = photo,
        hash = hash,
        document = document
      ))
    }
  )
)

