#' @export
BotAppSettings <- R6::R6Class(
  "BotAppSettings",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0xc99b1950,
    SUBCLASS_OF_ID = 0x179e62e3,

    placeholder_path = NULL,
    background_color = NULL,
    background_dark_color = NULL,
    header_color = NULL,
    header_dark_color = NULL,

    #' @description
    #' Initializes the BotAppSettings with the given parameters.
    #' @param placeholder_path A raw vector representing placeholder path bytes. Optional.
    #' @param background_color An integer representing the background color. Optional.
    #' @param background_dark_color An integer representing the dark background color. Optional.
    #' @param header_color An integer representing the header color. Optional.
    #' @param header_dark_color An integer representing the dark header color. Optional.
    initialize = function(placeholder_path = NULL, background_color = NULL, background_dark_color = NULL,
                          header_color = NULL, header_dark_color = NULL) {
      self$placeholder_path <- placeholder_path
      self$background_color <- background_color
      self$background_dark_color <- background_dark_color
      self$header_color <- header_color
      self$header_dark_color <- header_dark_color
    },

    #' @description
    #' Converts the BotAppSettings object to a list (dictionary).
    #' @return A list representation of the BotAppSettings object.
    to_dict = function() {
      return(list(
        `_` = "BotAppSettings",
        placeholder_path = self$placeholder_path,
        background_color = self$background_color,
        background_dark_color = self$background_dark_color,
        header_color = self$header_color,
        header_dark_color = self$header_dark_color
      ))
    },

    #' @description
    #' Serializes the BotAppSettings object to bytes.
    #' @return A raw vector representing the serialized bytes of the BotAppSettings object.
    bytes = function() {
      flags <- 0
      if (!is.null(self$placeholder_path)) flags <- flags + 1 # 2^0
      if (!is.null(self$background_color)) flags <- flags + 2 # 2^1
      if (!is.null(self$background_dark_color)) flags <- flags + 4 # 2^2
      if (!is.null(self$header_color)) flags <- flags + 8 # 2^3
      if (!is.null(self$header_dark_color)) flags <- flags + 16 # 2^4

      result <- list(
        as.raw(c(0x50, 0x19, 0x9b, 0xc9)),
        writeBin(as.integer(flags), raw(), size = 4, endian = "little")
      )

      if (!is.null(self$placeholder_path)) {
        result <- append(result, list(self$serializebytes(self$placeholder_path)))
      }
      if (!is.null(self$background_color)) {
        result <- append(result, list(writeBin(as.integer(self$background_color), raw(), size = 4, endian = "little")))
      }
      if (!is.null(self$background_dark_color)) {
        result <- append(result, list(writeBin(as.integer(self$background_dark_color), raw(), size = 4, endian = "little")))
      }
      if (!is.null(self$header_color)) {
        result <- append(result, list(writeBin(as.integer(self$header_color), raw(), size = 4, endian = "little")))
      }
      if (!is.null(self$header_dark_color)) {
        result <- append(result, list(writeBin(as.integer(self$header_dark_color), raw(), size = 4, endian = "little")))
      }

      return(do.call(c, result))
    }
  ),

  private = list(
    #' @description
    #' Reads a BotAppSettings object from a BinaryReader.
    #' @param reader A BinaryReader object to read from.
    #' @return An instance of BotAppSettings.
    from_reader = function(reader) {
      flags <- reader$read_int()

      placeholder_path <- NULL
      if (bitwAnd(flags, 1) != 0) {
        placeholder_path <- reader$tgreadbytes()
      }

      background_color <- NULL
      if (bitwAnd(flags, 2) != 0) {
        background_color <- reader$read_int()
      }

      background_dark_color <- NULL
      if (bitwAnd(flags, 4) != 0) {
        background_dark_color <- reader$read_int()
      }

      header_color <- NULL
      if (bitwAnd(flags, 8) != 0) {
        header_color <- reader$read_int()
      }

      header_dark_color <- NULL
      if (bitwAnd(flags, 16) != 0) {
        header_dark_color <- reader$read_int()
      }

      return(BotAppSettings$new(
        placeholder_path = placeholder_path,
        background_color = background_color,
        background_dark_color = background_dark_color,
        header_color = header_color,
        header_dark_color = header_dark_color
      ))
    }
  )
)

#' @export
BotBusinessConnection <- R6::R6Class(
  "BotBusinessConnection",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x8f34b2f5,
    SUBCLASS_OF_ID = 0x9b130546,

    connection_id = NULL,
    user_id = NULL,
    dc_id = NULL,
    date = NULL,
    disabled = NULL,
    rights = NULL,

    #' @description
    #' Initializes the BotBusinessConnection with the given parameters.
    #' @param connection_id A string representing the connection ID.
    #' @param user_id An integer representing the user ID.
    #' @param dc_id An integer representing the data center ID.
    #' @param date A datetime object representing the date. Optional.
    #' @param disabled A boolean indicating if disabled. Optional.
    #' @param rights A TLObject representing the rights. Optional.
    initialize = function(connection_id, user_id, dc_id, date = NULL, disabled = NULL, rights = NULL) {
      self$connection_id <- connection_id
      self$user_id <- user_id
      self$dc_id <- dc_id
      self$date <- date
      self$disabled <- disabled
      self$rights <- rights
    },

    #' @description
    #' Converts the BotBusinessConnection object to a list (dictionary).
    #' @return A list representation of the BotBusinessConnection object.
    to_dict = function() {
      result <- list(
        `_` = "BotBusinessConnection",
        connection_id = self$connection_id,
        user_id = self$user_id,
        dc_id = self$dc_id
      )

      if (!is.null(self$date)) {
        result$date <- self$date
      }
      if (!is.null(self$disabled)) {
        result$disabled <- self$disabled
      }
      if (!is.null(self$rights)) {
        result$rights <- if (inherits(self$rights, "TLObject")) self$rights$to_dict() else self$rights
      }

      return(result)
    },

    #' @description
    #' Serializes the BotBusinessConnection object to bytes.
    #' @return A raw vector representing the serialized bytes of the BotBusinessConnection object.
    bytes = function() {
      flags <- 0
      if (!is.null(self$disabled)) flags <- flags + 2 # 2^1
      if (!is.null(self$rights)) flags <- flags + 4 # 2^2

      result <- list(
        as.raw(c(0xf5, 0xb2, 0x34, 0x8f)),
        writeBin(as.integer(flags), raw(), size = 4, endian = "little"),
        self$serializebytes(self$connection_id),
        writeBin(as.numeric(self$user_id), raw(), size = 8, endian = "little"),
        writeBin(as.integer(self$dc_id), raw(), size = 4, endian = "little"),
        self$serialize_datetime(self$date)
      )

      if (!is.null(self$rights)) {
        result <- append(result, list(self$rights$`bytes`()))
      }

      return(do.call(c, result))
    }
  ),

  private = list(
    #' @description
    #' Reads a BotBusinessConnection object from a BinaryReader.
    #' @param reader A BinaryReader object to read from.
    #' @return An instance of BotBusinessConnection.
    from_reader = function(reader) {
      flags <- reader$read_int()

      disabled <- NULL
      if (bitwAnd(flags, 2) != 0) {
        disabled <- TRUE
      }

      connection_id <- reader$tgread_string()
      user_id <- reader$read_long()
      dc_id <- reader$read_int()
      date <- reader$tgread_date()

      rights <- NULL
      if (bitwAnd(flags, 4) != 0) {
        rights <- reader$tgread_object()
      }

      return(BotBusinessConnection$new(
        connection_id = connection_id,
        user_id = user_id,
        dc_id = dc_id,
        date = date,
        disabled = disabled,
        rights = rights
      ))
    }
  )
)

