#' @export
BotInfo <- R6::R6Class(
  "BotInfo",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x4d8a0299,
    SUBCLASS_OF_ID = 0xf1f701db,

    has_preview_medias = NULL,
    user_id = NULL,
    description = NULL,
    description_photo = NULL,
    description_document = NULL,
    commands = NULL,
    menu_button = NULL,
    privacy_policy_url = NULL,
    app_settings = NULL,
    verifier_settings = NULL,

    #' @description
    #' Initializes the BotInfo with the given parameters.
    #' @param has_preview_medias A boolean indicating if has preview medias. Optional.
    #' @param user_id An integer representing the user ID. Optional.
    #' @param description A string representing the description. Optional.
    #' @param description_photo A TLObject representing the description photo. Optional.
    #' @param description_document A TLObject representing the description document. Optional.
    #' @param commands A list of TLObjects representing commands. Optional.
    #' @param menu_button A TLObject representing the menu button. Optional.
    #' @param privacy_policy_url A string representing the privacy policy URL. Optional.
    #' @param app_settings A TLObject representing the app settings. Optional.
    #' @param verifier_settings A TLObject representing the verifier settings. Optional.
    initialize = function(has_preview_medias = NULL, user_id = NULL, description = NULL, description_photo = NULL,
                          description_document = NULL, commands = NULL, menu_button = NULL, privacy_policy_url = NULL,
                          app_settings = NULL, verifier_settings = NULL) {
      self$has_preview_medias <- has_preview_medias
      self$user_id <- user_id
      self$description <- description
      self$description_photo <- description_photo
      self$description_document <- description_document
      self$commands <- commands
      self$menu_button <- menu_button
      self$privacy_policy_url <- privacy_policy_url
      self$app_settings <- app_settings
      self$verifier_settings <- verifier_settings
    },

    #' @description
    #' Converts the BotInfo object to a list (dictionary).
    #' @return A list representation of the BotInfo object.
    to_dict = function() {
      result <- list(`_` = "BotInfo")

      if (!is.null(self$has_preview_medias)) {
        result$has_preview_medias <- self$has_preview_medias
      }
      if (!is.null(self$user_id)) {
        result$user_id <- self$user_id
      }
      if (!is.null(self$description)) {
        result$description <- self$description
      }
      if (!is.null(self$description_photo)) {
        result$description_photo <- if (inherits(self$description_photo, "TLObject")) self$description_photo$to_dict() else self$description_photo
      }
      if (!is.null(self$description_document)) {
        result$description_document <- if (inherits(self$description_document, "TLObject")) self$description_document$to_dict() else self$description_document
      }
      if (!is.null(self$commands)) {
        result$commands <- lapply(self$commands, function(x) if (inherits(x, "TLObject")) x$to_dict() else x)
      }
      if (!is.null(self$menu_button)) {
        result$menu_button <- if (inherits(self$menu_button, "TLObject")) self$menu_button$to_dict() else self$menu_button
      }
      if (!is.null(self$privacy_policy_url)) {
        result$privacy_policy_url <- self$privacy_policy_url
      }
      if (!is.null(self$app_settings)) {
        result$app_settings <- if (inherits(self$app_settings, "TLObject")) self$app_settings$to_dict() else self$app_settings
      }
      if (!is.null(self$verifier_settings)) {
        result$verifier_settings <- if (inherits(self$verifier_settings, "TLObject")) self$verifier_settings$to_dict() else self$verifier_settings
      }

      return(result)
    },

    #' @description
    #' Serializes the BotInfo object to bytes.
    #' @return A raw vector representing the serialized bytes of the BotInfo object.
    bytes = function() {
      flags <- 0
      if (!is.null(self$has_preview_medias)) flags <- flags + 64 # 2^6
      if (!is.null(self$user_id)) flags <- flags + 1 # 2^0
      if (!is.null(self$description)) flags <- flags + 2 # 2^1
      if (!is.null(self$description_photo)) flags <- flags + 16 # 2^4
      if (!is.null(self$description_document)) flags <- flags + 32 # 2^5
      if (!is.null(self$commands)) flags <- flags + 4 # 2^2
      if (!is.null(self$menu_button)) flags <- flags + 8 # 2^3
      if (!is.null(self$privacy_policy_url)) flags <- flags + 128 # 2^7
      if (!is.null(self$app_settings)) flags <- flags + 256 # 2^8
      if (!is.null(self$verifier_settings)) flags <- flags + 512 # 2^9

      result <- list(
        as.raw(c(0x99, 0x02, 0x8a, 0x4d)),
        writeBin(as.integer(flags), raw(), size = 4, endian = "little")
      )

      if (!is.null(self$user_id)) {
        result <- append(result, list(writeBin(as.numeric(self$user_id), raw(), size = 8, endian = "little")))
      }
      if (!is.null(self$description)) {
        result <- append(result, list(self$serializebytes(self$description)))
      }
      if (!is.null(self$description_photo)) {
        result <- append(result, list(self$description_photo$`bytes`()))
      }
      if (!is.null(self$description_document)) {
        result <- append(result, list(self$description_document$`bytes`()))
      }
      if (!is.null(self$commands)) {
        result <- append(result, list(
          as.raw(c(0x15, 0xc4, 0xb5, 0x1c)),
          writeBin(as.integer(length(self$commands)), raw(), size = 4, endian = "little"),
          do.call(c, lapply(self$commands, function(x) x$`bytes`()))
        ))
      }
      if (!is.null(self$menu_button)) {
        result <- append(result, list(self$menu_button$`bytes`()))
      }
      if (!is.null(self$privacy_policy_url)) {
        result <- append(result, list(self$serializebytes(self$privacy_policy_url)))
      }
      if (!is.null(self$app_settings)) {
        result <- append(result, list(self$app_settings$`bytes`()))
      }
      if (!is.null(self$verifier_settings)) {
        result <- append(result, list(self$verifier_settings$`bytes`()))
      }

      return(do.call(c, result))
    }
  ),

  private = list(
    #' @description
    #' Reads a BotInfo object from a BinaryReader.
    #' @param reader A BinaryReader object to read from.
    #' @return An instance of BotInfo.
    from_reader = function(reader) {
      flags <- reader$read_int()

      has_preview_medias <- NULL
      if (bitwAnd(flags, 64) != 0) {
        has_preview_medias <- TRUE
      }

      user_id <- NULL
      if (bitwAnd(flags, 1) != 0) {
        user_id <- reader$read_long()
      }

      description <- NULL
      if (bitwAnd(flags, 2) != 0) {
        description <- reader$tgread_string()
      }

      description_photo <- NULL
      if (bitwAnd(flags, 16) != 0) {
        description_photo <- reader$tgread_object()
      }

      description_document <- NULL
      if (bitwAnd(flags, 32) != 0) {
        description_document <- reader$tgread_object()
      }

      commands <- NULL
      if (bitwAnd(flags, 4) != 0) {
        reader$read_int() # Skip vector constructor
        commands <- list()
        for (i in 1:reader$read_int()) {
          commands <- append(commands, list(reader$tgread_object()))
        }
      }

      menu_button <- NULL
      if (bitwAnd(flags, 8) != 0) {
        menu_button <- reader$tgread_object()
      }

      privacy_policy_url <- NULL
      if (bitwAnd(flags, 128) != 0) {
        privacy_policy_url <- reader$tgread_string()
      }

      app_settings <- NULL
      if (bitwAnd(flags, 256) != 0) {
        app_settings <- reader$tgread_object()
      }

      verifier_settings <- NULL
      if (bitwAnd(flags, 512) != 0) {
        verifier_settings <- reader$tgread_object()
      }

      return(BotInfo$new(
        has_preview_medias = has_preview_medias,
        user_id = user_id,
        description = description,
        description_photo = description_photo,
        description_document = description_document,
        commands = commands,
        menu_button = menu_button,
        privacy_policy_url = privacy_policy_url,
        app_settings = app_settings,
        verifier_settings = verifier_settings
      ))
    }
  )
)

