  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0xb4ae666f,
    SUBCLASS_OF_ID = 0x3c0d4a8b,
    link = NULL,
    message = NULL,
    views = NULL,
    entities = NULL,
    title = NULL,
    initialize = function(link, message, views, entities = NULL, title = NULL) {
      self$link <- link
      self$message <- message
      self$views <- views
      self$entities <- entities
      self$title <- title
    },
    to_dict = function() {
      dict <- list(
        "_" = "BusinessChatLink",
        "link" = self$link,
        "message" = self$message,
        "views" = self$views,
        "entities" = if (is.null(self$entities)) list() else lapply(self$entities, function(x) if (inherits(x, "TLObject")) x$to_dict() else x),
        "title" = self$title
      )
      dict
    }
  ),
  active = list(
    serialize = function() {
      flags <- bitwOr(
        if (is.null(self$entities)) 0 else 1,
        if (is.null(self$title)) 0 else 2
      )

      result <- c(
        packInt32(self$CONSTRUCTOR_ID),
        writeBin(flags, raw(), size = 4, endian = "little"),
        self$serializebytes(self$link),
        self$serializebytes(self$message)
      )

      if (!is.null(self$entities)) {
        result <- c(
          result,
          writeBin(as.integer(0x15c4b51c), raw(), size = 4, endian = "little"),
          writeBin(length(self$entities), raw(), size = 4, endian = "little"),
          unlist(lapply(self$entities, function(x) x$serialize()))
        )
      }

      if (!is.null(self$title)) {
        result <- c(result, self$serializebytes(self$title))
      }

      result <- c(result, writeBin(self$views, raw(), size = 4, endian = "little"))
      result
