#' @export
BusinessRecipients <- R6::R6Class(
  "BusinessRecipients",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x21108ff7,
    SUBCLASS_OF_ID = 0x52852e46,
    existing_chats = NULL,
    new_chats = NULL,
    contacts = NULL,
    non_contacts = NULL,
    exclude_selected = NULL,
    users = NULL,
    initialize = function(existing_chats = NULL, new_chats = NULL, contacts = NULL, non_contacts = NULL, exclude_selected = NULL, users = NULL) {
      self$existing_chats <- existing_chats
      self$new_chats <- new_chats
      self$contacts <- contacts
      self$non_contacts <- non_contacts
      self$exclude_selected <- exclude_selected
      self$users <- users
    },
    to_dict = function() {
      dict <- list(
        "_" = "BusinessRecipients",
        "existing_chats" = self$existing_chats,
        "new_chats" = self$new_chats,
        "contacts" = self$contacts,
        "non_contacts" = self$non_contacts,
        "exclude_selected" = self$exclude_selected,
        "users" = if (is.null(self$users)) list() else self$users
      )
      dict
    }
  ),
  active = list(
    serialize = function() {
      flag_values <- c(
        if (is.null(self$existing_chats) || !self$existing_chats) 0 else 1,
        if (is.null(self$new_chats) || !self$new_chats) 0 else 2,
        if (is.null(self$contacts) || !self$contacts) 0 else 4,
        if (is.null(self$non_contacts) || !self$non_contacts) 0 else 8,
        if (is.null(self$exclude_selected) || !self$exclude_selected) 0 else 32,
        if (is.null(self$users)) 0 else 16
      )

      flags <- Reduce(bitwOr, as.integer(flag_values), init = 0L)

      result <- c(
        packInt32(self$CONSTRUCTOR_ID),
        writeBin(flags, raw(), size = 4, endian = "little")
      )

      if (!is.null(self$users)) {
        result <- c(
          result,
          writeBin(as.integer(0x15c4b51c), raw(), size = 4, endian = "little"),
          writeBin(length(self$users), raw(), size = 4, endian = "little"),
          unlist(lapply(self$users, function(x) writeBin(x, raw(), size = 8, endian = "little")))
        )
      }

      result
    }
  ),
  private = list(
    from_reader = function(reader) {
      flags <- reader$read_int()

      existing_chats <- bitwAnd(flags, 1) != 0
      new_chats <- bitwAnd(flags, 2) != 0
      contacts <- bitwAnd(flags, 4) != 0
      non_contacts <- bitwAnd(flags, 8) != 0
      exclude_selected <- bitwAnd(flags, 32) != 0

      users <- NULL
      if (bitwAnd(flags, 16) != 0) {
        reader$read_int() # vector constructor
        users_count <- reader$read_int()
        users <- lapply(1:users_count, function(i) reader$read_long())
      }

      self$initialize(existing_chats, new_chats, contacts, non_contacts, exclude_selected, users)
    }
  )
)

