#' @export
ChannelParticipantAdmin <- R6::R6Class(
  "ChannelParticipantAdmin",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x34c3bb53,
    SUBCLASS_OF_ID = 0xd9c7fc18,
    user_id = NULL,
    promoted_by = NULL,
    date = NULL,
    admin_rights = NULL,
    can_edit = NULL,
    is_self = NULL,
    inviter_id = NULL,
    rank = NULL,
    initialize = function(user_id, promoted_by, date, admin_rights, can_edit = NULL, is_self = NULL, inviter_id = NULL, rank = NULL) {
      self$user_id <- user_id
      self$promoted_by <- promoted_by
      self$date <- date
      self$admin_rights <- admin_rights
      self$can_edit <- can_edit
      self$is_self <- is_self
      self$inviter_id <- inviter_id
      self$rank <- rank
    },
    to_dict = function() {
      list(
        "_" = "ChannelParticipantAdmin",
        user_id = self$user_id,
        promoted_by = self$promoted_by,
        date = self$date,
        admin_rights = if (inherits(self$admin_rights, "TLObject")) self$admin_rights$to_dict() else self$admin_rights,
        can_edit = self$can_edit,
        is_self = self$is_self,
        inviter_id = self$inviter_id,
        rank = self$rank
      )
    },
    bytes = function() {
      # is_self and inviter_id must both be NULL/FALSE or both not
      stopifnot(
        ((self$is_self || !is.null(self$is_self)) && (self$inviter_id || !is.null(self$inviter_id))) ||
          ((is.null(self$is_self) || identical(self$is_self, FALSE)) && (is.null(self$inviter_id) || identical(self$inviter_id, FALSE)))
      )
      flags <- (if (!is.null(self$can_edit) && self$can_edit) 1 else 0) |
        (if (!is.null(self$is_self) && self$is_self) 2 else 0) |
        (if (!is.null(self$inviter_id) && !identical(self$inviter_id, FALSE)) 2 else 0) |
        (if (!is.null(self$rank) && !identical(self$rank, FALSE)) 4 else 0)
      c(
        as.raw(c(0x53, 0xbb, 0xc3, 0x34)),
        writeBin(as.integer(flags), raw(), size = 4),
        writeBin(as.numeric(self$user_id), raw(), size = 8),
        if (is.null(self$inviter_id) || identical(self$inviter_id, FALSE)) raw() else writeBin(as.numeric(self$inviter_id), raw(), size = 8),
        writeBin(as.numeric(self$promoted_by), raw(), size = 8),
        self$serialize_datetime(self$date),
        self$admin_rights$bytes(),
        if (is.null(self$rank) || identical(self$rank, FALSE)) raw() else self$serializebytes(self$rank)
      )
    }
  ),
  private = list(
    from_reader = function(reader) {
      flags <- reader$read_int()
      can_edit <- bitwAnd(flags, 1) != 0
      is_self <- bitwAnd(flags, 2) != 0
      user_id <- reader$read_long()
      inviter_id <- if (bitwAnd(flags, 2) != 0) reader$read_long() else NULL
      promoted_by <- reader$read_long()
      date <- reader$tgread_date()
      admin_rights <- reader$tgread_object()
      rank <- if (bitwAnd(flags, 4) != 0) reader$tgread_string() else NULL
      ChannelParticipantAdmin$new(
        user_id = user_id, promoted_by = promoted_by, date = date, admin_rights = admin_rights,
        can_edit = can_edit, is_self = is_self, inviter_id = inviter_id, rank = rank
      )
    }
  )
)

