  "ChannelParticipantCreator",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x2fe601d3,
    SUBCLASS_OF_ID = 0xd9c7fc18,
    user_id = NULL,
    admin_rights = NULL,
    rank = NULL,
