      }
      b
    }
  ),
  private = list(
    from_reader = function(reader) {
      flags <- reader$read_int()
      q <- if (bitwAnd(flags, 1)) reader$tgread_string() else NULL
      top_msg_id <- if (bitwAnd(flags, 2)) reader$read_int() else NULL
      ChannelParticipantsMentions$new(q = q, top_msg_id = top_msg_id)
