FutureSalt <- R6::R6Class("FutureSalt",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x0949d9dc,
    SUBCLASS_OF_ID = 0x0949d9dc,

    valid_since = NULL,
