#' @export
InputStickerSetItem <- R6::R6Class(
  "InputStickerSetItem",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x32da9e9c,
    SUBCLASS_OF_ID = 0xae59f075,
    initialize = function(document, emoji, mask_coords = NULL, keywords = NULL) {
      self$document <- document
      self$emoji <- emoji
      self$mask_coords <- mask_coords
      self$keywords <- keywords
    },
    to_dict = function() {
      list("_" = "InputStickerSetItem", document = if (inherits(self$document, "TLObject")) self$document$to_dict() else self$document, emoji = self$emoji, mask_coords = if (inherits(self$mask_coords, "TLObject")) self$mask_coords$to_dict() else self$mask_coords, keywords = self$keywords)
    },
    bytes = function() {
      flags <- (if (is.null(self$mask_coords) || self$mask_coords == FALSE) 0 else 1) | (if (is.null(self$keywords) || self$keywords == FALSE) 0 else 2)
      c(as.raw(c(0x9c, 0x9e, 0xda, 0x32)), packBits(intToBits(flags), type = "raw")[1:4], self$document$bytes(), charToRaw(self$emoji), if (!is.null(self$mask_coords)) self$mask_coords$bytes() else raw(0), if (!is.null(self$keywords)) charToRaw(self$keywords) else raw(0))
    }
  ),
  private = list(
    from_reader = function(reader) {
      flags <- reader$read_int()
      document <- reader$tgread_object()
      emoji <- reader$tgread_string()
      mask_coords <- if (bitwAnd(flags, 1)) reader$tgread_object() else NULL
      keywords <- if (bitwAnd(flags, 2)) reader$tgread_string() else NULL
      self$initialize(document = document, emoji = emoji, mask_coords = mask_coords, keywords = keywords)
    }
  )
)

