#' @export
InputStorePaymentAuthCode <- R6::R6Class(
  "InputStorePaymentAuthCode",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x9bb2636d,
    SUBCLASS_OF_ID = 0xe7a4174d,
    initialize = function(phone_number, phone_code_hash, currency, amount, restore = NULL) {
      self$phone_number <- phone_number
      self$phone_code_hash <- phone_code_hash
      self$currency <- currency
      self$amount <- amount
      self$restore <- restore
    },
    to_dict = function() {
      list("_" = "InputStorePaymentAuthCode", phone_number = self$phone_number, phone_code_hash = self$phone_code_hash, currency = self$currency, amount = self$amount, restore = self$restore)
    },
    bytes = function() {
      flags <- if (is.null(self$restore) || self$restore == FALSE) 0 else 1
      c(as.raw(c(0x6d, 0x63, 0xb2, 0x9b)), packBits(intToBits(flags), type = "raw")[1:4], charToRaw(self$phone_number), charToRaw(self$phone_code_hash), charToRaw(self$currency), packBits(intToBits(self$amount), type = "raw")[1:8])
    }
  ),
  private = list(
    from_reader = function(reader) {
      flags <- reader$read_int()
      restore <- bitwAnd(flags, 1) != 0
      phone_number <- reader$tgread_string()
      phone_code_hash <- reader$tgread_string()
      currency <- reader$tgread_string()
      amount <- reader$read_long()
      self$initialize(phone_number = phone_number, phone_code_hash = phone_code_hash, currency = currency, amount = amount, restore = restore)
    }
  )
)

