#' @export
KeyboardButtonSwitchInline <- R6::R6Class("KeyboardButtonSwitchInline",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x93b9fbb5,
    SUBCLASS_OF_ID = 0xbad74a3,
    initialize = function(text, query, samepeer = NULL, peer_types = NULL) {
      self$text <- text
      self$query <- query
      self$samepeer <- samepeer
      self$peer_types <- peer_types
    },
    to_dict = function() {
      list("_" = "KeyboardButtonSwitchInline", text = self$text, query = self$query, samepeer = self$samepeer, peer_types = lapply(self$peer_types, function(x) if (inherits(x, "TLObject")) x$to_dict() else x))
    },
    bytes = function() {
      flags <- (if (is.null(self$samepeer) || !self$samepeer) 0 else 1) | (if (is.null(self$peer_types)) 0 else 2)
      peer_typesbytes <- if (is.null(self$peer_types)) raw() else c(as.raw(c(0x15, 0xc4, 0xb5, 0x1c)), writeBin(length(self$peer_types), raw(), size = 4, endian = "little"), do.call(c, lapply(self$peer_types, function(x) x$bytes())))
      c(as.raw(c(0xb5, 0xfb, 0xb9, 0x93)), writeBin(flags, raw(), size = 4, endian = "little"), if (is.null(self$samepeer)) raw() else raw(), self$serializebytes(self$text), self$serializebytes(self$query), peer_typesbytes)
    }
  ),
  private = list(
    from_reader = function(reader) {
      flags <- reader$read_int()
      samepeer <- bitwAnd(flags, 1) != 0
      text <- reader$tgread_string()
      query <- reader$tgread_string()
      if (bitwAnd(flags, 2)) {
        reader$read_int()
        peer_types <- list()
        for (i in 1:reader$read_int()) {
          x <- reader$tgread_object()
          peer_types <- c(peer_types, list(x))
        }
      } else {
        peer_types <- NULL
      }
      self$initialize(text = text, query = query, samepeer = samepeer, peer_types = peer_types)
      self
    }
  )
)

