#' @export
MessageActionConferenceCall <- R6::R6Class("MessageActionConferenceCall",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x2ffe2f7a,
    SUBCLASS_OF_ID = 0x8680d126,
    call_id = NULL,
    missed = NULL,
    active = NULL,
    video = NULL,
    duration = NULL,
    other_participants = NULL,
    initialize = function(call_id, missed = NULL, active = NULL, video = NULL, duration = NULL, other_participants = NULL) {
      self$call_id <- call_id
      self$missed <- missed
      self$active <- active
      self$video <- video
      self$duration <- duration
      self$other_participants <- other_participants
    },
    to_dict = function() {
      list(
        `_` = "MessageActionConferenceCall",
        call_id = self$call_id,
        missed = self$missed,
        active = self$active,
        video = self$video,
        duration = self$duration,
        other_participants = if (is.null(self$other_participants)) NULL else lapply(self$other_participants, function(x) if (inherits(x, "TLObject")) x$to_dict() else x)
      )
    },
    bytes = function() {
      raw(0)
    }
  ),
  private = list(
    from_reader = function(reader) {
      flags <- reader$read_int()
      missed <- bitwAnd(flags, 1L) != 0L
      active <- bitwAnd(flags, 2L) != 0L
      video <- bitwAnd(flags, 16L) != 0L
      call_id <- reader$read_long()
      duration <- if (bitwAnd(flags, 4L) != 0L) reader$read_int() else NULL
      other_participants <- NULL
      if (bitwAnd(flags, 8L) != 0L) {
        # vector of TLObjects
        reader$read_int() # marker read (depending on your reader implementation)
        n <- reader$read_int()
        other_participants <- lapply(seq_len(n), function(i) reader$tgread_object())
      }
      list(call_id = call_id, missed = missed, active = active, video = video, duration = duration, other_participants = other_participants)
    }
  ),
  class = TRUE
)

