    from_reader = function(reader) {
      flags <- reader$read_int()
      min <- as.logical(bitwAnd(flags, 1))
      can_see_list <- as.logical(bitwAnd(flags, 4))
      reactions_as_tags <- as.logical(bitwAnd(flags, 8))

      reader$read_int() # vector constructor for results
      n <- reader$read_int()
      results <- list()
      if (n > 0) {
        for (i in seq_len(n)) results[[i]] <- reader$tgread_object()
      }

      if (bitwAnd(flags, 2) != 0) {
        reader$read_int()
        m <- reader$read_int()
        recent_reactions <- list()
        if (m > 0) {
          for (i in seq_len(m)) recent_reactions[[i]] <- reader$tgread_object()
        }
      } else {
        recent_reactions <- NULL
      }

      if (bitwAnd(flags, 16) != 0) {
        reader$read_int()
        k <- reader$read_int()
        top_reactors <- list()
        if (k > 0) {
          for (i in seq_len(k)) top_reactors[[i]] <- reader$tgread_object()
        }
      } else {
        top_reactors <- NULL
      }

      self$new(results = results, min = min, can_see_list = can_see_list, reactions_as_tags = reactions_as_tags, recent_reactions = recent_reactions, top_reactors = top_reactors)
    }
  ),
  class = TRUE
)

