#' @export
Page <- R6::R6Class(
  "Page",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x98657f0d,
    SUBCLASS_OF_ID = 0xb438191e,
    url = NULL,
    blocks = NULL,
    photos = NULL,
    documents = NULL,
    part = NULL,
    rtl = NULL,
    v2 = NULL,
    views = NULL,
    initialize = function(url = NULL, blocks = list(), photos = list(), documents = list(), part = NULL, rtl = NULL, v2 = NULL, views = NULL) {
      self$url <- url
      self$blocks <- blocks
      self$photos <- photos
      self$documents <- documents
      self$part <- part
      self$rtl <- rtl
      self$v2 <- v2
      self$views <- views
    },
    to_dict = function() {
      list(
        `_` = "Page",
        url = self$url,
        blocks = self$blocks,
        photos = self$photos,
        documents = self$documents,
        part = self$part,
        rtl = self$rtl,
        v2 = self$v2,
        views = self$views
      )
    },
    bytes = function() raw(0)
  ),
  private = list(
    from_reader = function(reader) {
      flags <- reader$read_int()
      part <- as.logical(bitwAnd(flags, 1))
      rtl <- as.logical(bitwAnd(flags, 2))
      v2 <- as.logical(bitwAnd(flags, 4))
      url <- reader$tgread_string()
      n_blocks <- reader$read_int()
      blocks <- vector("list", n_blocks)
      if (n_blocks > 0) for (i in seq_len(n_blocks)) blocks[[i]] <- reader$tgread_object()
      n_photos <- reader$read_int()
      photos <- vector("list", n_photos)
      if (n_photos > 0) for (i in seq_len(n_photos)) photos[[i]] <- reader$tgread_object()
      n_docs <- reader$read_int()
      documents <- vector("list", n_docs)
      if (n_docs > 0) for (i in seq_len(n_docs)) documents[[i]] <- reader$tgread_object()
      views <- if (bitwAnd(flags, 8) != 0) reader$read_int() else NULL
      self$new(url = url, blocks = blocks, photos = photos, documents = documents, part = part, rtl = rtl, v2 = v2, views = views)
    }
  ),
  class = TRUE
)

