      current <- bitwAnd(flags, 2) != 0
      can_purchase_upgrade <- bitwAnd(flags, 4) != 0
      transaction <- if (bitwAnd(flags, 8) != 0) reader$tgread_string() else NULL
      months <- reader$read_int()
      currency <- reader$tgread_string()
      amount <- reader$read_long()
      bot_url <- reader$tgread_string()
      store_product <- if (bitwAnd(flags, 1) != 0) reader$tgread_string() else NULL
      list(months = months, currency = currency, amount = amount, bot_url = bot_url, current = current, can_purchase_upgrade = can_purchase_upgrade, transaction = transaction, store_product = store_product)
    }
  ),
  class = TRUE
)

