#' @export
ResPQ <- R6::R6Class("ResPQ",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x5162463,
    SUBCLASS_OF_ID = 0x786986b8,
    nonce = NULL,
    server_nonce = NULL,
    pq = NULL,
    server_public_key_fingerprints = NULL,
    initialize = function(nonce = NULL, server_nonce = NULL, pq = NULL, server_public_key_fingerprints = NULL) {
      self$nonce <- nonce
      self$server_nonce <- server_nonce
      self$pq <- pq
      self$server_public_key_fingerprints <- server_public_key_fingerprints
    },
    to_dict = function() list(`_` = "ResPQ", nonce = self$nonce, server_nonce = self$server_nonce, pq = self$pq, server_public_key_fingerprints = self$server_public_key_fingerprints),
    bytes = function() as.raw(c(0x63, 0x24, 0x16, 0x05)) + self$nonce$tobytes(16, "little", TRUE) + self$server_nonce$tobytes(16, "little", TRUE) + self$serializebytes(self$pq) + as.raw(c(0x1c, 0xb5, 0xc4, 0x15)) + pack("i", length(self$server_public_key_fingerprints)) + do.call(c, lapply(self$server_public_key_fingerprints, function(x) pack("q", x)))
  ),
  private = list(
    from_reader = function(reader) {
      nonce <- reader$read_large_int(bits = 128)
      server_nonce <- reader$read_large_int(bits = 128)
      pq <- reader$tgreadbytes()
      reader$read_int()
      server_public_key_fingerprints <- lapply(seq_len(reader$read_int()), function(i) reader$read_long())
      self$new(nonce = nonce, server_nonce = server_nonce, pq = pq, server_public_key_fingerprints = server_public_key_fingerprints)
    }
  ),
  class = TRUE
)

