      self$type <- type
      self$hash <- hash
      self$data <- data
      self$front_side <- front_side
      self$reverse_side <- reverse_side
      self$selfie <- selfie
      self$translation <- translation
      self$files <- files
      self$plaindata <- plaindata
    },
    to_dict = function() list(`_` = "SecureValue", type = if (is.null(self$type)) NULL else self$type$to_dict(), hash = self$hash, data = if (is.null(self$data)) NULL else self$data$to_dict(), front_side = if (is.null(self$front_side)) NULL else self$front_side$to_dict(), reverse_side = if (is.null(self$reverse_side)) NULL else self$reverse_side$to_dict(), selfie = if (is.null(self$selfie)) NULL else self$selfie$to_dict(), translation = if (is.null(self$translation)) list() else lapply(self$translation, function(x) x$to_dict()), files = if (is.null(self$files)) list() else lapply(self$files, function(x) x$to_dict()), plaindata = if (is.null(self$plaindata)) NULL else self$plaindata$to_dict()),
    bytes = function() {
      flags <- 0
      if (!is.null(self$data)) flags <- bitwOr(flags, 1)
      if (!is.null(self$front_side)) flags <- bitwOr(flags, 2)
      if (!is.null(self$reverse_side)) flags <- bitwOr(flags, 4)
      if (!is.null(self$selfie)) flags <- bitwOr(flags, 8)
      if (!is.null(self$translation)) flags <- bitwOr(flags, 64)
      if (!is.null(self$files)) flags <- bitwOr(flags, 16)
      if (!is.null(self$plaindata)) flags <- bitwOr(flags, 32)
      as.raw(c(0xca, 0xa0, 0x7f, 0x18)) + pack("I", flags) + self$type$bytes() + if (!is.null(self$data)) self$data$bytes() else raw(0) + if (!is.null(self$front_side)) self$front_side$bytes() else raw(0) + if (!is.null(self$reverse_side)) self$reverse_side$bytes() else raw(0) + if (!is.null(self$selfie)) self$selfie$bytes() else raw(0) + if (!is.null(self$translation)) as.raw(c(0x1c, 0xb5, 0xc4, 0x15)) + pack("i", length(self$translation)) + do.call(c, lapply(self$translation, function(x) x$bytes())) else raw(0) + if (!is.null(self$files)) as.raw(c(0x1c, 0xb5, 0xc4, 0x15)) + pack("i", length(self$files)) + do.call(c, lapply(self$files, function(x) x$bytes())) else raw(0) + if (!is.null(self$plaindata)) self$plaindata$bytes() else raw(0) + self$serializebytes(self$hash)
    }
