      if (bitwAnd(flags, 2) != 0) front_side <- reader$tgread_object() else front_side <- NULL
      if (bitwAnd(flags, 4) != 0) reverse_side <- reader$tgread_object() else reverse_side <- NULL
      if (bitwAnd(flags, 8) != 0) selfie <- reader$tgread_object() else selfie <- NULL
      if (bitwAnd(flags, 64) != 0) {
        reader$read_int()
        translation <- lapply(seq_len(reader$read_int()), function(i) reader$tgread_object())
      } else {
        translation <- NULL
      }
      if (bitwAnd(flags, 16) != 0) {
        reader$read_int()
        files <- lapply(seq_len(reader$read_int()), function(i) reader$tgread_object())
      } else {
        files <- NULL
      }
      if (bitwAnd(flags, 32) != 0) plaindata <- reader$tgread_object() else plaindata <- NULL
