  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0xb5890dba,
    SUBCLASS_OF_ID = 0xc69a67bc,
    initialize = function(nonce, server_nonce, g, dh_prime, g_a, server_time) {
      self$nonce <- nonce
      self$server_nonce <- server_nonce
      self$g <- g
      self$dh_prime <- dh_prime
      self$g_a <- g_a
      self$server_time <- server_time
    },
    to_dict = function() {
      list(
        `_` = "ServerDHInnerData",
        nonce = self$nonce,
        server_nonce = self$server_nonce,
        g = self$g,
        dh_prime = self$dh_prime,
        g_a = self$g_a,
        server_time = self$server_time
      )
    },
    bytes = function() {
      c(as.raw(c(0xba, 0x0d, 0x89, 0xb5)), self$nonce$tobytes(16, "little", TRUE), self$server_nonce$tobytes(16, "little", TRUE), pack("i", self$g), self$serializebytes(self$dh_prime), self$serializebytes(self$g_a), pack("i", self$server_time))
    }
  ),
  private = list(
    from_reader = function(reader) {
      nonce <- reader$read_large_int(bits = 128)
      server_nonce <- reader$read_large_int(bits = 128)
      g <- reader$read_int()
      dh_prime <- reader$tgreadbytes()
      g_a <- reader$tgreadbytes()
      server_time <- reader$read_int()
      self$initialize(nonce, server_nonce, g, dh_prime, g_a, server_time)
    }
  ),
  class = TRUE
)

