#' @export
ShippingOption <- R6::R6Class(
  "ShippingOption",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0xb6213cdf,
    SUBCLASS_OF_ID = 0xf4e94c78,
    initialize = function(id, title, prices) {
      self$id <- id
      self$title <- title
      self$prices <- prices
    },
    to_dict = function() {
      list(
        `_` = "ShippingOption",
        id = self$id,
        title = self$title,
        prices = lapply(self$prices, function(x) if (inherits(x, "R6")) x$to_dict() else x)
      )
    },
    bytes = function() {
      as.raw(c(0xdf, 0x3c, 0x21, 0xb6)) +
        self$serializebytes(self$id) +
        self$serializebytes(self$title) +
        as.raw(c(0x15, 0xc4, 0xb5, 0x1c)) + pack("i", length(self$prices)) + do.call(c, lapply(self$prices, function(x) x$bytes()))
    }
  ),
  private = list(
    from_reader = function(reader) {
      id <- reader$tgread_string()
      title <- reader$tgread_string()
      reader$read_int()
      prices <- list()
      for (i in 1:reader$read_int()) {
        x <- reader$tgread_object()
        prices <- c(prices, list(x))
      }
      self$initialize(id, title, prices)
      self
    }
  ),
  class = TRUE
)

