#' @export
SponsoredMessage <- R6::R6Class(
  "SponsoredMessage",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x7dbf8673,
    SUBCLASS_OF_ID = 0xe157d836,
    initialize = function(url, title, message, button_text, recommended = NULL, can_report = NULL, random_id = NULL, entities = NULL, photo = NULL, media = NULL, color = NULL, sponsor_info = NULL, additional_info = NULL, min_display_duration = NULL, max_display_duration = NULL) {
      self$url <- url
      self$title <- title
      self$message <- message
      self$button_text <- button_text
      self$recommended <- recommended
      self$can_report <- can_report
      self$random_id <- if (is.null(random_id)) intToBits(sample(.Machine$integer.max, 1)) else random_id
      self$entities <- entities
      self$photo <- photo
      self$media <- media
      self$color <- color
      self$sponsor_info <- sponsor_info
      self$additional_info <- additional_info
      self$min_display_duration <- min_display_duration
      self$max_display_duration <- max_display_duration
    },
    to_dict = function() {
      list(
        `_` = "SponsoredMessage",
        url = self$url,
        title = self$title,
        message = self$message,
        button_text = self$button_text,
        recommended = self$recommended,
        can_report = self$can_report,
        random_id = self$random_id,
        entities = if (is.null(self$entities)) list() else lapply(self$entities, function(x) if (inherits(x, "R6")) x$to_dict() else x),
        photo = if (inherits(self$photo, "R6")) self$photo$to_dict() else self$photo,
        media = if (inherits(self$media, "R6")) self$media$to_dict() else self$media,
        color = if (inherits(self$color, "R6")) self$color$to_dict() else self$color,
        sponsor_info = self$sponsor_info,
        additional_info = self$additional_info,
        min_display_duration = self$min_display_duration,
        max_display_duration = self$max_display_duration
      )
    },
    bytes = function() {
      flags <- (if (is.null(self$recommended) || !self$recommended) 0 else 32) |
        (if (is.null(self$can_report) || !self$can_report) 0 else 4096) |
        (if (is.null(self$entities) || length(self$entities) == 0) 0 else 2) |
        (if (is.null(self$photo)) 0 else 64) |
        (if (is.null(self$media)) 0 else 16384) |
        (if (is.null(self$color)) 0 else 8192) |
        (if (is.null(self$sponsor_info)) 0 else 128) |
        (if (is.null(self$additional_info)) 0 else 256) |
        (if (is.null(self$min_display_duration)) 0 else 32768) |
        (if (is.null(self$max_display_duration)) 0 else 32768)
      stopifnot((!is.null(self$min_display_duration) && !is.null(self$max_display_duration)) || (is.null(self$min_display_duration) && is.null(self$max_display_duration)))
      as.raw(c(0x73, 0x86, 0xbf, 0x7d)) +
        pack("I", flags) +
        self$serializebytes(self$random_id) +
        self$serializebytes(self$url) +
        self$serializebytes(self$title) +
        self$serializebytes(self$message) +
        if (is.null(self$entities) || length(self$entities) == 0) {
          raw(0)
        } else {
          as.raw(c(0x15, 0xc4, 0xb5, 0x1c)) + pack("i", length(self$entities)) + do.call(c, lapply(self$entities, function(x) x$bytes())) +
            if (is.null(self$photo)) {
              raw(0)
            } else {
              self$photo$bytes() +
                if (is.null(self$media)) {
                  raw(0)
                } else {
                  self$media$bytes() +
                    if (is.null(self$color)) {
                      raw(0)
                    } else {
                      self$color$bytes() +
                        self$serializebytes(self$button_text) +
                        if (is.null(self$sponsor_info)) {
                          raw(0)
                        } else {
                          self$serializebytes(self$sponsor_info) +
                            if (is.null(self$additional_info)) {
                              raw(0)
                            } else {
                              self$serializebytes(self$additional_info) +
                                if (is.null(self$min_display_duration)) {
                                  raw(0)
                                } else {
                                  pack("i", self$min_display_duration) +
                                    if (is.null(self$max_display_duration)) raw(0) else pack("i", self$max_display_duration)
                                }
                            }
                        }
                    }
                }
            }
        }
    }
  ),
  private = list(
    from_reader = function(reader) {
      flags <- reader$read_int()
      recommended <- bitwAnd(flags, 32) != 0
      can_report <- bitwAnd(flags, 4096) != 0
      random_id <- reader$tgreadbytes()
      url <- reader$tgread_string()
      title <- reader$tgread_string()
      message <- reader$tgread_string()
      entities <- if (bitwAnd(flags, 2) != 0) {
        reader$read_int()
        lapply(1:reader$read_int(), function(i) reader$tgread_object())
      } else {
        NULL
      }
      photo <- if (bitwAnd(flags, 64) != 0) reader$tgread_object() else NULL
      media <- if (bitwAnd(flags, 16384) != 0) reader$tgread_object() else NULL
      color <- if (bitwAnd(flags, 8192) != 0) reader$tgread_object() else NULL
      button_text <- reader$tgread_string()
      sponsor_info <- if (bitwAnd(flags, 128) != 0) reader$tgread_string() else NULL
      additional_info <- if (bitwAnd(flags, 256) != 0) reader$tgread_string() else NULL
      min_display_duration <- if (bitwAnd(flags, 32768) != 0) reader$read_int() else NULL
      max_display_duration <- if (bitwAnd(flags, 32768) != 0) reader$read_int() else NULL
      self$initialize(url, title, message, button_text, recommended, can_report, random_id, entities, photo, media, color, sponsor_info, additional_info, min_display_duration, max_display_duration)
      self
    }
  ),
  class = TRUE
)

