#' @export
StarGift <- R6::R6Class(
  "StarGift",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x80ac53c3,
    SUBCLASS_OF_ID = 0xc31c590b,
    initialize = function(id, sticker, stars, convert_stars, limited = NULL, sold_out = NULL, birthday = NULL, require_premium = NULL, limited_per_user = NULL, availability_remains = NULL, availability_total = NULL, availability_resale = NULL, first_sale_date = NULL, last_sale_date = NULL, upgrade_stars = NULL, resell_min_stars = NULL, title = NULL, released_by = NULL, per_user_total = NULL, per_user_remains = NULL, locked_until_date = NULL) {
      self$id <- id
      self$sticker <- sticker
      self$stars <- stars
      self$convert_stars <- convert_stars
      self$limited <- limited
      self$sold_out <- sold_out
      self$birthday <- birthday
      self$require_premium <- require_premium
      self$limited_per_user <- limited_per_user
      self$availability_remains <- availability_remains
      self$availability_total <- availability_total
      self$availability_resale <- availability_resale
      self$first_sale_date <- first_sale_date
      self$last_sale_date <- last_sale_date
      self$upgrade_stars <- upgrade_stars
      self$resell_min_stars <- resell_min_stars
      self$title <- title
      self$released_by <- released_by
      self$per_user_total <- per_user_total
      self$per_user_remains <- per_user_remains
      self$locked_until_date <- locked_until_date
    },
    to_dict = function() {
      list(
        `_` = "StarGift",
        id = self$id,
        sticker = if (inherits(self$sticker, "R6")) self$sticker$to_dict() else self$sticker,
        stars = self$stars,
        convert_stars = self$convert_stars,
        limited = self$limited,
        sold_out = self$sold_out,
        birthday = self$birthday,
        require_premium = self$require_premium,
        limited_per_user = self$limited_per_user,
        availability_remains = self$availability_remains,
        availability_total = self$availability_total,
        availability_resale = self$availability_resale,
        first_sale_date = self$first_sale_date,
        last_sale_date = self$last_sale_date,
        upgrade_stars = self$upgrade_stars,
        resell_min_stars = self$resell_min_stars,
        title = self$title,
        released_by = if (inherits(self$released_by, "R6")) self$released_by$to_dict() else self$released_by,
        per_user_total = self$per_user_total,
        per_user_remains = self$per_user_remains,
        locked_until_date = self$locked_until_date
      )
    },
    bytes = function() {
      flags <- (if (is.null(self$limited) || !self$limited) 0 else 1) |
        (if (is.null(self$sold_out) || !self$sold_out) 0 else 2) |
        (if (is.null(self$birthday) || !self$birthday) 0 else 4) |
        (if (is.null(self$require_premium) || !self$require_premium) 0 else 128) |
        (if (is.null(self$limited_per_user) || !self$limited_per_user) 0 else 256) |
        (if (is.null(self$availability_remains)) 0 else 1) |
        (if (is.null(self$availability_total)) 0 else 1) |
        (if (is.null(self$availability_resale)) 0 else 16) |
        (if (is.null(self$first_sale_date)) 0 else 2) |
        (if (is.null(self$last_sale_date)) 0 else 2) |
        (if (is.null(self$upgrade_stars)) 0 else 8) |
        (if (is.null(self$resell_min_stars)) 0 else 16) |
        (if (is.null(self$title)) 0 else 32) |
        (if (is.null(self$released_by)) 0 else 64) |
        (if (is.null(self$per_user_total)) 0 else 256) |
        (if (is.null(self$per_user_remains)) 0 else 256) |
        (if (is.null(self$locked_until_date)) 0 else 512)
      stopifnot((!is.null(self$limited) && !is.null(self$availability_remains) && !is.null(self$availability_total)) || (is.null(self$limited) && is.null(self$availability_remains) && is.null(self$availability_total)))
      stopifnot((!is.null(self$sold_out) && !is.null(self$first_sale_date) && !is.null(self$last_sale_date)) || (is.null(self$sold_out) && is.null(self$first_sale_date) && is.null(self$last_sale_date)))
      stopifnot((!is.null(self$limited_per_user) && !is.null(self$per_user_total) && !is.null(self$per_user_remains)) || (is.null(self$limited_per_user) && is.null(self$per_user_total) && is.null(self$per_user_remains)))
      stopifnot((!is.null(self$availability_resale) && !is.null(self$resell_min_stars)) || (is.null(self$availability_resale) && is.null(self$resell_min_stars)))
      as.raw(c(0xc3, 0x53, 0xac, 0x80)) +
        pack("I", flags) +
        pack("q", self$id) +
        self$sticker$bytes() +
        pack("q", self$stars) +
        if (is.null(self$availability_remains)) {
          raw(0)
        } else {
          pack("i", self$availability_remains) +
            if (is.null(self$availability_total)) {
              raw(0)
            } else {
              pack("i", self$availability_total) +
                if (is.null(self$availability_resale)) {
                  raw(0)
                } else {
                  pack("q", self$availability_resale) +
                    pack("q", self$convert_stars) +
                    if (is.null(self$first_sale_date)) {
                      raw(0)
                    } else {
                      self$serialize_datetime(self$first_sale_date) +
                        if (is.null(self$last_sale_date)) {
                          raw(0)
                        } else {
                          self$serialize_datetime(self$last_sale_date) +
                            if (is.null(self$upgrade_stars)) {
                              raw(0)
                            } else {
                              pack("q", self$upgrade_stars) +
                                if (is.null(self$resell_min_stars)) {
                                  raw(0)
                                } else {
                                  pack("q", self$resell_min_stars) +
                                    if (is.null(self$title)) {
                                      raw(0)
                                    } else {
                                      self$serializebytes(self$title) +
                                        if (is.null(self$released_by)) {
                                          raw(0)
                                        } else {
                                          self$released_by$bytes() +
                                            if (is.null(self$per_user_total)) {
                                              raw(0)
                                            } else {
                                              pack("i", self$per_user_total) +
                                                if (is.null(self$per_user_remains)) {
                                                  raw(0)
                                                } else {
                                                  pack("i", self$per_user_remains) +
                                                    if (is.null(self$locked_until_date)) raw(0) else self$serialize_datetime(self$locked_until_date)
                                                }
                                            }
                                        }
                                    }
                                }
                            }
                        }
                    }
                }
            }
        }
    }
  ),
  private = list(
    from_reader = function(reader) {
      flags <- reader$read_int()
      limited <- bitwAnd(flags, 1) != 0
      sold_out <- bitwAnd(flags, 2) != 0
      birthday <- bitwAnd(flags, 4) != 0
      require_premium <- bitwAnd(flags, 128) != 0
      limited_per_user <- bitwAnd(flags, 256) != 0
      id <- reader$read_long()
      sticker <- reader$tgread_object()
      stars <- reader$read_long()
      availability_remains <- if (bitwAnd(flags, 1) != 0) reader$read_int() else NULL
      availability_total <- if (bitwAnd(flags, 1) != 0) reader$read_int() else NULL
      availability_resale <- if (bitwAnd(flags, 16) != 0) reader$read_long() else NULL
      convert_stars <- reader$read_long()
      first_sale_date <- if (bitwAnd(flags, 2) != 0) reader$tgread_date() else NULL
      last_sale_date <- if (bitwAnd(flags, 2) != 0) reader$tgread_date() else NULL
      upgrade_stars <- if (bitwAnd(flags, 8) != 0) reader$read_long() else NULL
      resell_min_stars <- if (bitwAnd(flags, 16) != 0) reader$read_long() else NULL
      title <- if (bitwAnd(flags, 32) != 0) reader$tgread_string() else NULL
      released_by <- if (bitwAnd(flags, 64) != 0) reader$tgread_object() else NULL
      per_user_total <- if (bitwAnd(flags, 256) != 0) reader$read_int() else NULL
      per_user_remains <- if (bitwAnd(flags, 256) != 0) reader$read_int() else NULL
      locked_until_date <- if (bitwAnd(flags, 512) != 0) reader$tgread_date() else NULL
      self$initialize(id, sticker, stars, convert_stars, limited, sold_out, birthday, require_premium, limited_per_user, availability_remains, availability_total, availability_resale, first_sale_date, last_sale_date, upgrade_stars, resell_min_stars, title, released_by, per_user_total, per_user_remains, locked_until_date)
      self
    }
  ),
  class = TRUE
)

