      require_premium <- bitwAnd(flags, 64) != 0
      resale_ton_only <- bitwAnd(flags, 128) != 0
      theme_available <- bitwAnd(flags, 512) != 0
      id <- reader$read_long()
      gift_id <- reader$read_long()
