      slug <- reader$tgread_string()
      num <- reader$read_int()
      owner_id <- if (bitwAnd(flags, 1) != 0) reader$tgread_object() else NULL
      owner_name <- if (bitwAnd(flags, 2) != 0) reader$tgread_string() else NULL
      owner_address <- if (bitwAnd(flags, 4) != 0) reader$tgread_string() else NULL
      reader$read_int()
      attributes <- lapply(1:reader$read_int(), function(i) reader$tgread_object())
      availability_issued <- reader$read_int()
      availability_total <- reader$read_int()
      gift_address <- if (bitwAnd(flags, 8) != 0) reader$tgread_string() else NULL
      resell_amount <- if (bitwAnd(flags, 16) != 0) {
        reader$read_int()
        lapply(1:reader$read_int(), function(i) reader$tgread_object())
      } else {
        NULL
      }
      released_by <- if (bitwAnd(flags, 32) != 0) reader$tgread_object() else NULL
      value_amount <- if (bitwAnd(flags, 256) != 0) reader$read_long() else NULL
      value_currency <- if (bitwAnd(flags, 256) != 0) reader$tgread_string() else NULL
