      self$initialize(id, gift_id, title, slug, num, attributes, availability_issued, availability_total, require_premium, resale_ton_only, theme_available, owner_id, owner_name, owner_address, gift_address, resell_amount, released_by, value_amount, value_currency, themepeer)
