    initialize = function(id, access_hash, slug, title, creator = NULL, default = NULL, for_chat = NULL, document = NULL, settings = NULL, emoticon = NULL, installs_count = NULL) {
      self$id <- id
      self$access_hash <- access_hash
      self$slug <- slug
      self$title <- title
      self$creator <- creator
      self$default <- default
      self$for_chat <- for_chat
      self$document <- document
      self$settings <- settings
      self$emoticon <- emoticon
      self$installs_count <- installs_count
    },
    to_dict = function() {
      list(`_` = "Theme", id = self$id, access_hash = self$access_hash, slug = self$slug, title = self$title, creator = self$creator, default = self$default, for_chat = self$for_chat, document = if (is.null(self$document)) NULL else self$document$to_dict(), settings = if (is.null(self$settings)) NULL else lapply(self$settings, function(x) x$to_dict()), emoticon = self$emoticon, installs_count = self$installs_count)
    },
    bytes = function() {
      flags <- (if (is.null(self$creator) || !self$creator) 0 else 1) | (if (is.null(self$default) || !self$default) 0 else 2) | (if (is.null(self$for_chat) || !self$for_chat) 0 else 32) | (if (is.null(self$document)) 0 else 4) | (if (is.null(self$settings)) 0 else 8) | (if (is.null(self$emoticon)) 0 else 64) | (if (is.null(self$installs_count)) 0 else 16)
      as.raw(c(0xd6, 0x67, 0x0e, 0xa0)) + pack("I", flags) + pack("q", self$id) + pack("q", self$access_hash) + self$serializebytes(self$slug) + self$serializebytes(self$title) + (if (is.null(self$document)) raw(0) else self$document$bytes()) + (if (is.null(self$settings)) raw(0) else as.raw(c(0x15, 0xc4, 0xb5, 0x1c)) + pack("i", length(self$settings)) + do.call(c, lapply(self$settings, function(x) x$bytes()))) + (if (is.null(self$emoticon)) raw(0) else self$serializebytes(self$emoticon)) + (if (is.null(self$installs_count)) raw(0) else pack("i", self$installs_count))
    }
  ),
  private = list(
    from_reader = function(reader) {
      flags <- reader$read_int()
      creator <- (flags & 1) != 0
      default <- (flags & 2) != 0
      for_chat <- (flags & 32) != 0
      id <- reader$read_long()
      access_hash <- reader$read_long()
      slug <- reader$tgread_string()
      title <- reader$tgread_string()
      document <- if ((flags & 4) != 0) reader$tgread_object() else NULL
      settings <- if ((flags & 8) != 0) {
        reader$read_int()
        lapply(seq_len(reader$read_int()), function(i) reader$tgread_object())
      } else {
        NULL
      }
