#' @export
ThemeSettings <- R6::R6Class("ThemeSettings",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0xfa58b6d4,
    SUBCLASS_OF_ID = 0x82666d38,
    initialize = function(base_theme, accent_color, message_colors_animated = NULL, outbox_accent_color = NULL, message_colors = NULL, wallpaper = NULL) {
      self$base_theme <- base_theme
      self$accent_color <- accent_color
      self$message_colors_animated <- message_colors_animated
      self$outbox_accent_color <- outbox_accent_color
      self$message_colors <- message_colors
      self$wallpaper <- wallpaper
    },
    to_dict = function() {
      list(`_` = "ThemeSettings", base_theme = self$base_theme$to_dict(), accent_color = self$accent_color, message_colors_animated = self$message_colors_animated, outbox_accent_color = self$outbox_accent_color, message_colors = self$message_colors, wallpaper = if (is.null(self$wallpaper)) NULL else self$wallpaper$to_dict())
    },
    bytes = function() {
      flags <- (if (is.null(self$message_colors_animated) || !self$message_colors_animated) 0 else 4) | (if (is.null(self$outbox_accent_color)) 0 else 8) | (if (is.null(self$message_colors)) 0 else 1) | (if (is.null(self$wallpaper)) 0 else 2)
      as.raw(c(0xd4, 0xb6, 0x58, 0xfa)) + pack("I", flags) + self$base_theme$bytes() + pack("i", self$accent_color) + (if (is.null(self$outbox_accent_color)) raw(0) else pack("i", self$outbox_accent_color)) + (if (is.null(self$message_colors)) raw(0) else as.raw(c(0x15, 0xc4, 0xb5, 0x1c)) + pack("i", length(self$message_colors)) + do.call(c, lapply(self$message_colors, function(x) pack("i", x)))) + (if (is.null(self$wallpaper)) raw(0) else self$wallpaper$bytes())
    }
  ),
  private = list(
    from_reader = function(reader) {
      flags <- reader$read_int()
      message_colors_animated <- (flags & 4) != 0
      base_theme <- reader$tgread_object()
      accent_color <- reader$read_int()
      outbox_accent_color <- if ((flags & 8) != 0) reader$read_int() else NULL
      message_colors <- if ((flags & 1) != 0) {
        reader$read_int()
        lapply(seq_len(reader$read_int()), function(i) reader$read_int())
      } else {
        NULL
      }
      wallpaper <- if ((flags & 2) != 0) reader$tgread_object() else NULL
      list(base_theme = base_theme, accent_color = accent_color, message_colors_animated = message_colors_animated, outbox_accent_color = outbox_accent_color, message_colors = message_colors, wallpaper = wallpaper)
    }
  ),
  class = TRUE
)

