        others_can_append = self$others_can_append,
        others_can_complete = self$others_can_complete
      )
    },
    bytes = function() {
      c(
        as.raw(c(0x26, 0x2a, 0xb9, 0x49)),
        pack("I", (if (is.null(self$others_can_append) || !self$others_can_append) 0 else 1) |
