#' @export
UpdateChannelParticipant <- R6::R6Class("UpdateChannelParticipant",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0x985d3abb,
    SUBCLASS_OF_ID = 0x9f89304e,
    initialize = function(channel_id, date, actor_id, user_id, qts, via_chatlist = NULL, prev_participant = NULL, new_participant = NULL, invite = NULL) {
      self$channel_id <- channel_id
      self$date <- date
      self$actor_id <- actor_id
      self$user_id <- user_id
      self$qts <- qts
      self$via_chatlist <- via_chatlist
      self$prev_participant <- prev_participant
      self$new_participant <- new_participant
      self$invite <- invite
    },
    to_dict = function() {
      list(
        `_` = "UpdateChannelParticipant",
        channel_id = self$channel_id,
        date = self$date,
        actor_id = self$actor_id,
        user_id = self$user_id,
        qts = self$qts,
        via_chatlist = self$via_chatlist,
        prev_participant = if (is.null(self$prev_participant)) NULL else self$prev_participant$to_dict(),
        new_participant = if (is.null(self$new_participant)) NULL else self$new_participant$to_dict(),
        invite = if (is.null(self$invite)) NULL else self$invite$to_dict()
      )
    },
    bytes = function() {
      c(
        as.raw(c(0xbb, 0x3a, 0x5d, 0x98)),
        pack("I", (if (is.null(self$via_chatlist) || !self$via_chatlist) 0 else 8) | (if (is.null(self$prev_participant)) 0 else 1) | (if (is.null(self$new_participant)) 0 else 2) | (if (is.null(self$invite)) 0 else 4)),
        pack("q", self$channel_id),
        self$serialize_datetime(self$date),
        pack("q", self$actor_id),
        pack("q", self$user_id),
        if (!is.null(self$prev_participant)) self$prev_participant$bytes() else raw(0),
        if (!is.null(self$new_participant)) self$new_participant$bytes() else raw(0),
        if (!is.null(self$invite)) self$invite$bytes() else raw(0),
        pack("i", self$qts)
      )
    }
  ),
  private = list(
    from_reader = function(reader) {
      flags <- reader$read_int()
