      actor_id <- reader$read_long()
      user_id <- reader$read_long()
      prev_participant <- if (flags & 1) reader$tgread_object() else NULL
      new_participant <- if (flags & 2) reader$tgread_object() else NULL
      invite <- if (flags & 4) reader$tgread_object() else NULL
      qts <- reader$read_int()
      self$initialize(channel_id, date, actor_id, user_id, qts, via_chatlist, prev_participant, new_participant, invite)
    }
  ),
  class = TRUE
)

