      self$user_id <- user_id
      self$msg_id <- msg_id
      self$chat_instance <- chat_instance
      self$data <- data
      self$game_short_name <- game_short_name
    },
    to_dict = function() {
      list(
        `_` = "UpdateInlineBotCallbackQuery",
