      data <- if (flags & 1) reader$tgreadbytes() else NULL
      game_short_name <- if (flags & 2) reader$tgread_string() else NULL
      self$initialize(query_id = query_id, user_id = user_id, msg_id = msg_id, chat_instance = chat_instance, data = data, game_short_name = game_short_name)
