#' @export
UpdateServiceNotification <- R6::R6Class("UpdateServiceNotification",
  inherit = TLObject,
  public = list(
    CONSTRUCTOR_ID = 0xebe46819,
    SUBCLASS_OF_ID = 0x9f89304e,
    initialize = function(type, message, media, entities, popup = NULL, invert_media = NULL, inbox_date = NULL) {
      self$type <- type
      self$message <- message
      self$media <- media
      self$entities <- entities
      self$popup <- popup
      self$invert_media <- invert_media
      self$inbox_date <- inbox_date
    },
    to_dict = function() {
      list(
        `_` = "UpdateServiceNotification",
        type = self$type,
        message = self$message,
        media = if (inherits(self$media, "TLObject")) self$media$to_dict() else self$media,
        entities = if (is.null(self$entities)) list() else lapply(self$entities, function(x) if (inherits(x, "TLObject")) x$to_dict() else x),
        popup = self$popup,
        invert_media = self$invert_media,
        inbox_date = self$inbox_date
      )
    },
    bytes = function() {
      flags <- (if (is.null(self$popup)) 0 else 1) | (if (is.null(self$invert_media)) 0 else 4) | (if (is.null(self$inbox_date)) 0 else 2)
      c(
        as.raw(c(0x19, 0x68, 0xe4, 0xeb)),
        pack("I", flags),
        if (!is.null(self$inbox_date)) self$serialize_datetime(self$inbox_date) else raw(0),
        self$serializebytes(self$type),
        self$serializebytes(self$message),
        self$media$bytes(),
        as.raw(c(0x15, 0xc4, 0xb5, 0x1c)),
        pack("i", length(self$entities)),
        do.call(c, lapply(self$entities, function(x) x$bytes()))
      )
    }
  ),
  private = list(
    from_reader = function(reader) {
      flags <- reader$read_int()
      popup <- (flags & 1) != 0
      invert_media <- (flags & 4) != 0
      inbox_date <- if (flags & 2) reader$tgread_date() else NULL
      type <- reader$tgread_string()
      message <- reader$tgread_string()
      media <- reader$tgread_object()
      reader$read_int()
      entities <- list()
      for (i in seq_len(reader$read_int())) {
        x <- reader$tgread_object()
        entities <- c(entities, list(x))
      }
      self$initialize(type, message, media, entities, popup, invert_media, inbox_date)
    }
  ),
  class = TRUE
)

